"rating":"4.5",
"reviewcomment":"San Francisco institution!!!<br><br>When I first moved here and started at CCSF I had heard everyone in the athletic department talking about roxies. Finally one of my coaches told me to go get him a sandwich and finally try it myself... let me tell you, I drove up to this place and thought that this was a joke... and then I got out of the car, the smell emanating from this little 2 aisle corner store was intoxicating!! As soon as you walk in you realize that this place is the real deal! All the sports memorabilia and history in this place is epic and that is before I even got a sandwich. They are a very close knit group of people that come here regularly and it is the last of a dieing breed of neighborhood joints where just about everyone knows everyone.<br><br>I ordered a supreme roast beef and swiss on sourdough. Holy crap this sandwich was huge! Definitely worth whatever price they wanted to put on it. <br>The sandwich was magical!<br>It was a sandwich that was made using high quality ingredients and no corners are cut here which is why this place is so popular and succesful!<br><br>IF YOU HAVE NEVER BEEN HERE.... GET OFF YELP AND GO GET A ROXIES SANDWICH... NOW!!",
