"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/1ibq_f5CTKCBH-YEvByDyg/l.jpg",
"rating":"4.5",
"reviewcomment":"Why would you go to Whole Foods when Haight Street Market is so close? Did you want to choose from 22 varieties of unsweetened almond milk instead of 10? Yeah, me neither. Haight Street Market is small, but somehow they have everything you need. The product choices are excellent, giving you plenty of options but not overwhelming you. You don&#39;t have to spend an extra ten minutes comparing boxes of cereal because your choice was made easier by limiting your options.<br><br>Everyone working at this place is helpful and friendly. You can get in and out of there quickly and you can also find some real gems* that you will just have to bring home. The fish, meats, cheeses and prepared foods all looked extremely fresh. You can do your regular food shopping here, you can grab coffee and a bagel, some prepared salads, pretty much anything, so there is no reason to support a chain when you can come here and feel better about yourself for doing so.<br>__________________<br>*Gems in any natural or organic food store means things you wouldn&#39;t normally get, but the combination of their packaging and ingredients &#34;force&#34; you to spend $10 on jelly or something similar. How can one pass up plum/lavender jelly? I know, you can&#39;t, it&#39;s near the cheeses.",
