"reviewcomment":"The Fizzary is a really fun store for kids, soda connoisseurs, or anyone who&#39;s trying to track down a long-lost beverage of their youth. It&#39;s not huge, but you&#39;ll be amazed at the sheer variety and selection of flavors and regional brands they carry.<br><br>The storefront has a great painted sign, and inside it&#39;s all hardwood floors, pressed tin ceilings, and old-tymey wooden display shelves showing off their sodas. The stock is arranged by flavor, which can be helpful as far as some of the more obscure sodas that don&#39;t have descriptions on the label. They also have a very cool super-fast drink chiller, shaped like a big barrel, that will make any bottle on the shelf deliciously cold in just a few minutes!<br><br>Pricing is straightforward -- $2/bottle, or $6 for a mix-n-match 4-pack, or $16 for a 12-pack mix-n-match. It&#39;s easy to get carried away by all the choices, especially if you&#39;re a visitor who can&#39;t carry glass bottles back home in your carry-on, so be ready to drink a LOT of soda, is all I&#39;m saying. Oh, and they also carry salt-water taffy sold by weight, and you get a free piece of candy with each bottle purchased.<br><br>Oh, and they have a nice selection of super-strong ginger beers, so if you&#39;re looking for fancy mixers for craft cocktails, this would be a good place to start!",
