"reviewcomment":"After seeing masses of locals hopping in line, I decided to throw my hat in as well.  Turning to yelp, I learned that the piece de resistance here is the egg custard tart.  Despite being only 8 or so people back in line (a very long line developed behind me), it still took 20-30 minutes to get my coveted tart.  People in front of me ordered by the dozen, and the ladies behind the counter were pulling them out of the oven as fast as possible but not keeping up with the demand.  The tarts are $1.80 each, which is a steal for how filling they are.  The flaky, crispy crust is delicious.  Where the custard started to set up and cool around the edges, I thought it was good.  Eggy, but slightly sweet.  For me, the hot jiggly center wasn&#39;t ideal, but I&#39;m happy I tried it and got the GG Bakery experience.  <br><br>I also ordered COCONUT MACAROONS, which can only be ordered in half dozen amounts.  While I didn&#39;t think I needed that many, I was later SOOOO glad I got them.  By far the best coconut macaroon I&#39;ve ever eaten.  It was carmelized and buttery and crunchy on the outside with a nice, sweet, soft, coconut bite in the middle.  I left the bakery to bike around the City for the day, and I was so thankful to have these gems in my bag to stave off starvation.",
