"reviewcomment":"Very happy to have discovered Chefler!!!! I love this business idea and hope Chefler grows with great success while still maintaing its excellent food quality and great customer service. <br><br>I love the competitive pricing Chefler offers, $7-$10 per meal delivered depending how many meals a week you order, way cheaper than munchery. You can&#39;t beat that. Also I like that they include estimated nutrition facts, that&#39;s awesome, munchery doesn&#39;t have that yet. They post the menu for the week online so you can select which days you want delivered and there are 3 meal options for each weekday. You must order one day prior to delivery by noon, which is fine because it helps you plan and also ensures they purchase the right amount of fresh ingredients needed. <br><br>Give this place a chance, you won&#39;t regret it. I of course had some very minor hiccups as any place can (one delivery not on time) but they always resolved their mistakes and have excellent customer service. One other minor thing to know as a heads up in case you have an allergy or some sort is they don&#39;t follow the menu exactly, but very similar -- for ex a dish might say it has broccoli and instead you get carrots or asparagus. Doesn&#39;t bother me at all but just in case you&#39;re picky or have dietary restrictions. <br><br>So far my fave dishes have been the pulled pork and apple tomatillo chicken! But really almost every dish has been great so far. This place is going to do great if they keep up their excellent customer service, quality tasty meals and excellent affordable pricing!! I LOVE CHEFLER!!",
