"rating":"5.0",
"reviewcomment":"These juices are the creme de la creme of juices!  I make green juice daily myself, but was looking for some juices to have on hand after surgery, when my mobility was going to be impaired.  I emailed them to see what they recommended, and got a quick response from Michelle.  She was quick to steer me toward Brain Power, the most nutrient dense juice, along with a handful of their other green juices.  I ordered the Brain Power, Green Machine, Zeus Juice, Liver Lover &amp; Orange Crush.  <br><br>These juices caught my attention because they are stored in glass bottles, and 100% organic.  In the past I have tried Blue Print Cleanse, Suja and Pressed Juicery.  I can&#39;t believe the difference between these and Living Greens.  They are really not in the same category, Living Greens is rich, velvety lusciousness.  Some of the others I have tasted like toilet water, seriously, my last cleanse with Pressed I ended early and couldn&#39;t finish the drinks.  I don&#39;t have the juices with fruit, except for apple, so some of their sweeter ones may be okay, but blak!<br><br>I live in the East Bay, so delivery would have cost me $45. plus toll fees.  Instead my daughter picked them up for me in the city, at their Bush St. location.  And yes I now have those bottles to return, but totally worth it.  Excellent!",
