"rating":"5.0",
"reviewcomment":"Wow! Oh man. So good!<br><br>OK, let me back up. When I was a little kid, I used to buy these little Bama pecan pies at the local U Tote &#39;Em (old school version of 7-11 in Texas). They were really delicious despite the fact that the jumbo pecans looked like cockroaches. Today at the San Mateo Farmers&#39; Market, I had some time to kill while I waited for a sandwich order to get made, so I strolled around. Lo and behold, I came across a small booth with two of the friendliest guys ever and an assortment of large and small pies. Immediately, my eyes were drawn to the small pecan pies which had that nostalgic Bama look. SOLD!<br><br>Now I&#39;m sitting here finishing up a BBQ sandwich and following it up with one of the most delicious little pecan pies I&#39;ve ever had! So good that it will eradicate the Bama nostalgia. The crust is flaky and buttery with a tiny bit of crunch. The pecans and the filling are a tiny bit savory and a tiny bit sweet, but not too much of either. A perfect balance! I kind of wish I had a scoop of vanilla ice cream to put on it, but it&#39;s great anyway!<br><br>I can&#39;t wait until next weekend to come back and try some of the other flavors!",
