"rating":"4.5",
"reviewcomment":"Ambiance: Very quaint and cute. Street parking is relatively limited so thank goodness someone was backing out when we arrived! Once you enter the store, you&#39;ll notice that on the left there is an array of delicious, mouth-watering American candy like strawberry tape, watermelon gummies, chocolate, gum drops, gummy bears and soooo much more. On the right, you&#39;ll notice an array of Chinese sweets like dried fruits, dried ginger, candied citrus peels, and more~! There are a few tables (maybe 2 or 3) and a bathroom in the back that you&#39;ll need a key to access. <br><br>Service: Service is so quick and definitely VERY friendly! :) I didn&#39;t know that it was cash only and I only had my card on me. Instead of giving me a hard time, the lil ol&#39; cashier lady just smiled at me and said something along the lines of: &#39;Ok no worries. I&#39;ll be right here. I&#39;ll keep your candy on the side.&#39; Such a sweet sweet lady. :) So I ran back to the car and thank god i dug a 20 dolla bill. <br><br>Food: - Almond milk w/ boba: BY FAR the BEST almond milk with boba I&#39;ve ever had. It&#39;s literally just almond milk + boba. way better than almond milk tea w/ boba. I went to this place on New Year&#39;s and I&#39;m still dreaming about this drink. <br>- Mini gummy bears: Favorite candy in the world. So rare to find. this store just earned major points for having it in stock. WOOO!<br>- Raspberry/Blackberry gummies: First time trying these here. Meh these are okay. Haven&#39;t gotten use to the outer shell part. It&#39;s like I&#39;m biting into a thin, sweet plastic before I get to the gummy middle. <br>- Strawberry tape: Yummmmmmmm. Reminds me of the movies~ <br>- Rock candy lollipops: Didn&#39;t try these because i don&#39;t like rock candy but the bf loved them. :P<br><br>Price: We spent about $16 for 2 drinks and 4 bags of candyyyyyy. Awesome sweet splurge to start the New Year&#39;s off right. ;)<br><br>Tip: - Almond milk with boba!<br>- CANDYYYYYY!!!!! is a must<br><br>Conclusion: Ohhhhhh hellll yes I&#39;m going to be back here when I&#39;m in the city. If only traffic getting here wasn&#39;t so crazy and if only this awesome boba shop was located closer, I would be here every day! BEST BOBA STORE I&#39;VE EVER BEEN TO IN MY LIFE!",
