"rating":"4.0",
"reviewcomment":"I had my wedding here last weekend and it was a dream come true! Patty helped me from start to finish, from showing us around the winery, to the rehearsal, and eventually coordinating the day. She was so helpful, kind, patient, and fun to work with! When we first visited the winery, my fiance and I fell in love with the breathtaking views and beautiful pavilion area. We knew we wanted our wedding here and signed the contract that day! We chose a day in February because of the discounted winter rate and prayed for a sunny day-which we got! The wind was still icy cold but it was gorgeous and sunny.<br><br>On the wedding day, we arrived and the girls went directly to the bridal suite. It was a perfect and cute little room where we got ready. There was a balcony outside which we would&#39;ve used more if it was warmer. The guys had their own room too upstairs. We had two hours to freshen up, relax, and take photos.<br><br>When I walked out to the ceremony with my mom by my side, it was more beautiful than I ever imagined! The wooden pavilion overlooks the vineyard and bay area, and since it was sunny and clear, we had a great view--though I was just staring at my now husband. After the cocktail hour and so many photos, we went to the reception. Surrounded by glass windows, family, and friends, we ate while watching the sun set. It was perfect. We were rushed at the end because we were going over time, but Patty was so gracious and patient with us, and throughout the whole day I was put to ease because I knew she was helping coordinate. If you&#39;re looking for a gorgeous venue for your wedding and love the rustic and naturey feel--look no further. It was the best day ever! :)",
