"reviewcomment":"So I should have written a review for this place a long time ago as we visited it last November.  <br>I was so excited to go here seeing as I&#39;m from England.  I was longing for good scones as for some reason the American scones are always so dry.  Also reading all the reviews and looking at the pictures was making my mouth water.<br><br>I kind of knew what to expect from reviews and pictures on Yelp, but actually stepping into this bakery and seeing all the goodies was another thing.  I was like a kid in a candy shop.  So many choices and wonderful flavors to choose from that I couldn&#39;t decide what to get.  I wanted one of everything.  Luckily there were a few samples on the counter which helped make my decision easier (but not much).  They had samples of their mince pies which are to die for and an Irish bread called Soda bread which was different (but good) that I&#39;d never tried before.  I really miss really good mice pies.  <br><br>OK so this is what I ended up getting:-<br>-4 Mince pies<br>-One plum pudding which I saved for Christmas so my family could try.  It&#39;s like a cross between Christmas pudding and fruit cake.  Moist, flavorful, and oh so good.  Next time I go I&#39;ll buy several of these as they do keep forever.  <br>-3 different pasties which me, my son, and husband ate for lunch.  Absolutely delicious<br>-A couple of scones.  I was in heaven eating them.  I didn&#39;t have any clotted cream so I ended up eating them with butter and jam. <br>-One loaf of their soda bread<br>-Several shortbread cookies for my son<br><br>I definitely want to go back and try their other baked goods and also their shepherd pie looked so delicious.  Just a shame that it&#39;s in SF and I live in the South Bay.",
