"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/0eYGgFbJRAUx6-rvuXQRMQ/l.jpg",
"rating":"4.5",
"reviewcomment":"If you&#39;re reading this review there are probably some things you&#39;re looking for in a coffee shop, and rather than write 65,792 words about how much I love this place, here is what you want to know: <br><br>In one sentence:<br>It&#39;s rad. Come here. <br><br>Is it quiet?<br>Yes. Very. It&#39;s very zen like. People talk in soft whispers, and there&#39;s classical music playing. <br><br>Is it comfy?<br>Yes. Very. They have bench seating against the wall, and a bunch of cozy chairs and tables.<br><br>Wifi?<br>Yes. Free? Yes. Good? Yes.<br>(do you know how many coffee shops (&#34;Bean There Cafe&#34;) have so many people and such crappy wifi? This place is rock solid. I&#39;ve never had a problem. <br><br>Is it good for large groups?<br>No. Definitely not. It&#39;s pretty small and cozy, would be hard to fit a bunch of people here.<br><br>How&#39;s the coffee?<br>It&#39;s decent. I&#39;m not a coffee snob, and I&#39;ll drink anything, so if you are a coffee snob, you probably won&#39;t like it here. It&#39;s not a squirt of sugar free vanilla, light, skinny, foam, no foam, kinda place. It&#39;s coffee.<br><br>How&#39;s the food?<br>I&#39;m a fan of the bagel sandwiches, and the Paninis.<br><br>Is this a good place to meet hot dudes?<br>Um...no. <br><br>Is this a good place to be seen, like, you know?<br>Um...no. That&#39;s the mission. <br><br>What&#39;s the vibe?<br>Awesome. If you&#39;re looking to catch up with all your best friends, then negative-orama. This isn&#39;t the place, go to 4 Barrel or Coffee Bean or Blue Bottle. Those places are way hip, and you&#39;re sure to meet a hot dude there. <br><br>The vibe is quiet. It&#39;s peaceful. It&#39;s &#34;getting away from it all.&#34; It actually kind of reminds me of Hawaii, sorta, if you kinda squint and look at it from the side. It&#39;s just mellow. <br><br>Summation:<br><br>I love this place. I&#39;ve been looking for a little spot to get work done, and this is perfect. <br>It&#39;s quite. The food&#39;s decent, the coffee is perfect. And Art, the owner (?), he&#39;s a doll. He&#39;s one of those people that just makes your day a little bit brighter, just because he&#39;s in the room.",
