"rating":"4.5",
"reviewcomment":"Absolute gem of a little shop! It&#39;s usually crowded, so upon entering, you take a number, and then decide what to get while you&#39;re waiting to be called. The line moves quickly, and the guys who work there are always nice (unlike the 24th St. Cheese Shop). No one tries to rush you, and based on your needs, they are very good at recommending different cheeses and giving you a sample to try. If you tell them you want a particular cheese to serve that night, they don&#39;t try to sell you a cheese that&#39;s not even close to being ripe. (Are you listening, 24th St. Cheese Shop?!)<br><br>In addition to great cheeses and cured meats, they have literally everything you need to make a fantastic Italian dinner. Their homemade sauces, pastas, and pizza dough are all fantastic. Even if you&#39;re running in for just one thing, you&#39;d be short-changing yourself if you didn&#39;t take a good look around for future reference because it&#39;s amazing what they are able to pack into this small yet well organized and tidy space. <br><br>If I had to make a tiny suggestion, I would say PLEASE consider opening on Sundays! People need to eat and entertain every day, not just Monday through Saturday. <br><br>Lucca Ravioli Company, don&#39;t go changin&#39;! We love you just the way you are! (OK, except for the Sunday thing.)",
