"rating":"4.5",
"reviewcomment":"Dear yelpers,<br><br>As I was having my tires fixed, I had 2 hours to spare with the goal to have some food with hopefully some kind of WIFI to entertain myself.   Well right around the corner of the car place I saw a little cafe whose identity was more confused than hybrid.  <br><br>After stumpling in this icecream, sandwich, gyro, sit around establishment, I regonized one of the sandwich makers who used to make me be the best sandwiches in Noe Valley.  I said hi and he regonized me right away and remembered what I used to order, he then recommended a new sandwich the Try Trick Me for only $7.75.   I was not tricked, the meat was succalent, and marinated with some spice just right.  The bread was fresh and toasty.  The pickle was just a skinny pickle one step away from being a shy cucumber dipped in pickle juice.   However the 3rd bite I just realized that I can not do my work I was meant to do as I had to have the second half before I even started anything incorporating keyboards and finger licking juicy dressing exploding out of the sandwich.   <br><br>As all true sandwich shops they had a wide variety of soft beverages with the must of the true sugar cane colas hecho en Mexico.  That combination was a suberbe. <br><br>The sandwich did not leave me any room for Ice Cream but did leave me some extra money I could spend wisely.  <br><br>The only downfall is that you can see that it is just opened a year ago, and wires are very in sight.  This could be easily modified and the owner was mentioning that he did all the work himself and he was planning to get some cool art work on the walls and apply for a wine license.  That could beat my Mexiican Cola and would even be better.<br><br>The WIFI was amazingly fast and for Free!  Please don&#39;t tell too many people as that could change with the beanies and beardies of SF downloading the latest mythbusters episodes :)",
