"rating":"4.0",
"reviewcomment":"One of my favorite places to shop of all time, I have started eating more healthy since I&#39;ve started to come here. <br><br>BULK FOOD. The bulk food section is amazing; this is really where you can get amazing value. Do you know how much you&#39;re spending in the supermarket when you buy spices in a new bottle eat time, and how much you can save when you buy cayenne or coriander out of bulk jars?<br><br>GET INSPIRED. I love the experience of bringing my own jars and have opened my mind up to cooking more, new recipes and new foods to try. The first time you come, I&#39;d recommend giving yourself an hour - it&#39;s a lot of fun to walk through the bulk foods aisle and see flours you never knew existed, be reminded of nuts that you had once heard were good for you, and realize that you forever more avoid store-bought peanut butter with their self-serve peanut butter section. Whoa!<br><br>PRODUCE. Produce items sometimes vary a bit in quality but.. hey, it&#39;s organic and if you&#39;ve never had a bad experience ever at any Safeway, I&#39;d be surprised.<br><br>CHEESE REGISTRY?! Great cheese selection. Did you know that they have a cheese registry? That&#39;s right - you can sign up and put your name on a list so that each time you come in, they&#39;ll refer to the list and let you know what cheeses you&#39;ve bought in the past in case you&#39;re trying to remember the name of that cheese you had a few months back.<br><br>SAMPLES. Cheese samples are always available and frequent food demonstrations (you can check online for the calendar of when tastings are happening).<br><br>Do note that this place is vegetarian, so if you&#39;re like me, you will have to go elsewhere for beef bouillon cubes or meat.<br><br>I try to go here weekly since I really can&#39;t see why I would go anywhere else to get the majority of my groceries. Love Rainbow!",
