"rating":"4.5",
"reviewcomment":"AMAZING. I&#39;ve been here on several occasions for small impromptu social gatherings with a couple of girlfriends and loved it. The wine selections are fantastic, the food options pair perfectly with the wine and the ambiance has the feel of a well appointed lounge. There are a lot of options to imbibe around the Union Square area, but you are looking for a place that prides itself on having the best of everything an oenophile would want - this is the spot to go. <br><br>In addition to all the great wine and food, they have standout service that sets them apart from the cookie cutter hospitality service you get from the average establishment. The ENO team is passionate and knowledgeable, truly going above and beyond to ensure you have an enjoyable experience. This very mantra was put to the test last night as we hosted a full buyout event for 200 people. The quality of the food and drink along with the stellar service did not waver despite the number of people being served. The staff was always friendly and professional and all of our guests were extremely pleased with the food and wine spread. <br><br>I wholeheartedly recommend ENO for a casual glass of wine to unwind or as a venue for your next special bash. When it comes to serving a small table to a large party, they maintain a standard of excellence that reflects the pride they have in their establishment.",
