"rating":"5.0",
"reviewcomment":"COFFEE LOVERS PARADISE!<br><br>Watch out Wonder Woman, you&#39;ve got competition.  Your Paradise Island just landed in San Francisco, COFFEE SHOP is coffee paradise!  This &#34;hole-in-the-wall&#34; is very special.  The fact that they serve YERBA MATE (their signature beverage) tells you how special this place is.  Organic Almond Honey, organic Valencia fresh squeeze orange juice... Wow, BAM!!  Homemade bake goods, cookies and chocolates.. double BAM!!<br><br>If the World Barista Championship judges were here with me, they would nod their head up and down, and say &#34;YES we agree,&#34; and will award my cappuccino, a &#34;Best Cappuccino Challenge!&#34;  Honestly, it has been the best I have had in years! <br><br>You can buy everything here.  Or they will deliver to you for free, in San Francisco that is, on their bikes if you order two or more bags of their organic coffee.  Just go to their website at: <a href='/redir?url=https%3A%2F%2Fsquareup.com%2Fmarket%2Fcoffeeshop&amp;s=7fc50d0fb642de4a0814f2f04914dd79dce0b1c1dc4bca7fcc602e048039c59f' target='_blank' rel='nofollow'>squareup.com/market/coff…</a>.  However, I suggest picking it up in person and enjoy a beverage or two!!<br><br>What a privilege to have met Wilson, the owner and his staff.  They provided me and my BFF a stellar &#34;Ritz Carlton,&#34; first class service.<br><br>Your initial visit here will give you 50% off any beverage.  It&#39;s an awesome deal!!  Don&#39;t forget to bring your pooch with you because you can sip and pet all at the same time, seated outdoors!  It&#39;s fantastic!!<br><br>Cheers! :p",
