"reviewcomment":"Wow, has it really been 2 years since my first review? I am long over due! When I saw the &#34;People love us on Yelp&#34; sticker today in All States I KNEW it was time for an update.<br><br>I am a weekly regular customer now. I try to make it a point to visit All States every week on the day I am in San Francisco. I have got my Mom hooked too. We can always find great deals here on produce and other goodies and always love to visit Mo and his brothers who help run the store. We love these guys. They honestly treat you like family.  Their kindness alone will make you want to come back and shop. <br><br>Seasonal fruits and veggies are coming in fast. All States has some really awesome promotional sale prices on fresh produce. They are constantly restocking and sometimes you can even pick right out of the box they picked up that morning during produce haul. I have got some GORGEOUS asparagus right out of the box, super fresh and on awesome sale (.99 cents - 1.99lb &#34;a bunch&#34; depending on sale - any figure in that range is a super good value). Today we scored some gorgeous plump and ripe seasonal figs and berries as well as other great produce finds. I am happy to see my Mom buy so many fresh fruits and veggies there when we go. Today she made herself a nice little picnic with some of her All State scores: fresh figs, cheese, cashews and personal sized avocados and Mo hooked her up with utensils and an area to wash some of her fruit she planned to go eat. He is so sweet. <br><br>This family really takes pride in keeping up their business, keeping well stocked and keeping their customers happy. This family and store is truly a gift to San Francisco.",
