"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/GRuPABgGugt3ccuUrtRudQ/l.jpg",
"rating":"4.0",
"reviewcomment":"What an incredible neighborhood restaurant! Going in to this dinner I knew the food was going to be good, but I didn&#39;t expect it to be exceptional. Baker and Banker is hands down one of the best meals I&#39;ve had in San Francisco! <br><br>Appetizer: House smoked trout &amp; hamachi crudo. The house smoked trout is a MUST order!!! I wasn&#39;t too crazy about the hamachi, there was something very tangy in the sauce that kind of threw me off...<br><br>Entree: Paella Risotto. I know right? A Paella made with risotto?! That was my first reaction and I&#39;m glad I went with my instinct and ordered it. It was absolutely exceptional! The flavors were bold and the quantity was just the right amount. <br><br>Desserts: I was a little disappointed that they didn&#39;t have the banana bread pudding that everyone was ranting and raving about here on yelp. I think they change up their menu quite often. Anyway, we ordered the banana, chocolate and peanut butter crisp with toffee crunch ice cream. OMG!!!! Heaven. In. My. Mouth. It was absolutely delish!!!!!!<br><br>We also got the coconut cream pie, it was delicious as well but the first dessert was significantly better. <br><br>Overall, love the vibe- not too formal, not casual, great service, amazing food :)",
