"reviewcomment":"Pretty awesome place to get fresh produce from local farmers and some other goodies for SF residents living close by<br><br>PROS:<br><br>Everything is very fresh and nice, just get here before 10am - before all the BEST stuff is gone ;-)<br><br>Lots of organic vendors from as far as 150+ miles radius <br><br>Nice baked goodies stand - with &#34;Pumpkin Bread&#34; and &#34;Coffee Cake&#34; (beware, you can get addicted to those!!!)<br><br>Prices are WAY cheaper for exactly same produce from same vendors, comparing to &#34;Ferry Building FM&#34; (I saw them on Saturday at &#34;Ferry Building&#34; and on Sunday over here at &#34;Stonestown FM&#34;)<br><br>Not as crowded as other Farmer Markers in the area and feels kind of cozy in a way <br><br>Vendors (farmers) are generally pretty friendly and as you keep buying from them on<br>regular basis, they will remember you and try to give you their best produce (thank you guys!!!)<br><br>CONS:<br><br>If you come after 11am - sometimes it&#39;s difficult to get parking <br><br>Holidays - due to &#34;pre-holiday&#34; shopping at the mall, here will NO parking whatsoever (but if you came here by like 9am, you will be still OK)",
