"reviewcomment":"I loved my first Munchery experience! Honestly, I wasn&#39;t expecting that much from a food delivery service- I was thinking, how good could a pre-cooked meal really be? But munchery just blew my mind. I heard good things about it from coworkers so I decided to give it a try when my bf and I were too lazy to go out. I still can&#39;t believe how cheap their food is (considering the quality and the fact that it&#39;s organic). I mean, how do they even make money? They&#39;re amazing. <br><br>They have a diverse selection of dishes to choose from online- I&#39;ve seen steak, burgers Moroccan chicken, pad Thai, ramen, pho, and so much more. They also have side dishes like salads and soup, dessert and wine! You can even read about the chefs that prepare your food! Pretty cool. <br><br>I loved everything that we decided to order and I also love how they&#39;re in oven/microwave-safe trays so we didn&#39;t even have to wash any dishes! The asparagus/pine nut salad was really fresh. Our steak was so good! We had to heat it up a bit more than instructed because it was still cold, but when ready, it was so tender and juicy- definitely restaurant-quality. I really liked my spring pasta that came with my steak too. We also ordered the zucchini apple oat bread and vanilla buttercream cake- both were so deliciously moist and the butter cream was perfect! Oh and they even gave us 2 really good and huge chocolate chip cookies for free with our order!<br><br>Not only is their food delicious, but they&#39;re also so punctual! We chose the 7-8pm time slot for delivery and they arrived at 7pm sharp. They even beat us home! <br><br>Tip: order a few days in advance because some dishes sell out!",
