"reviewcomment":"We did the Tasting Tour of Japantown, it was wonderful!<br><br>A couple friends told me that they need one more couple to go on the tour, they don&#39;t have enough people.  So I said OK. <br>When I told my boyfriend, he was like &#34;what&#34;?  Because we go to Japantown often, to watch movies (Kabuki Theater is definitely the best theater in town!) and have some sushi. <br>When we did the tour last Saturday, we enjoyed it very much.  We were both surprise that we don&#39;t know Japantown as well as we thought .  We&#39;ve learned a lot, and eat a lot too.<br><br>It turned out to be a full tour, there were 12 of us, all of us are from Bay Area.<br>We had &#34;sweet potato latte&#34;, none of us have heard about it, but all of us love it!  I&#39;ll get one every time I go to Japantown now.<br>I didn&#39;t know the corner store &#34;Benkyodo&#34; makes mocha from scratch every day.  The fresh mocha is 100 times better!!<br>We&#39;ve tried &#34;onigiri&#34; (Japanese rice ball), &#34;taiyaki&#34; (baked fish shape cake), udon.....<br><br>Last stop is Dosa Indian restaurant.  I like the idea that because it&#39;s in Japantown, why not includes them?  It&#39;s an open minded community!  <br>Dosa is a very elegant and high end Indian restaurant, we&#39;ve been there before and like it a lot.  They made the signature Dosa and homemade gin tonic for the tour which was great! <br><br>Tour guide was this very sweet Japanese lady who lives in Japantown.  She started with the history of the Japanese community, not too much to bored us.  She does a great job introducing Japanese food and culture.  She made the 3 and a half hour tour very pleasant!<br>I couldn&#39;t say enough great things about the tour!",
