"reviewcomment":"I&#39;ve done quite a few reviews of places in the Ferry Building SF&#39;s Embarcadero area, but of course this is because it is filled with excellent options.<br><br>Recchiuti Confections is among those excellent options. Of course, the shop here is only one outlet for these treats.<br><br>The wife and I love the rich, velveteen texture of their chocolates -- as well as the unique and distinctive flavor combinations.This isn&#39;t the first time we&#39;ve had confections that have gone for more adventurous combos, but I think Recchiuti are among the best at doing so... with items like Star Anise &amp; Pink Peppercorn, Lemon Verbena, Kona Coffee, Sesame Nougat etc.<br><br>Even their take on a &#34;crisped rice&#34; chocolate bar (which in their case uses toasted sesame) add a distinct, delicious twist to the flavor. I also like their single-source chocolates like Sur de Lago (all the chocolate is from one farm/region) as well as the ethos behind it.<br><br>Highly recommended.",
