"reviewcomment":"This is exactly what a friendly neighborhood grocery store should be! The produce is beautiful and fresh, the prices are very very reasonable. Sure, if you want really cheap stuff, hit up the Inner Richmond. But the stuff they sell here is like Whole Foods level goodness for so much cheaper. I swear, my yuppie organic mongering friends have given me their grocery lists so I can snag quality goodies for them from here.<br><br>Even more amazing than the products is the people themselves!! I love everyone who works here. They are never without a smile or a helpful tidbit about picking the ripest pineapple or the freshest greens. They really make sure their customers get the best stuff available. They also carry rare Hawaiian papayas (insanely delicious) and save some for their favorite regulars...hohoho. <br><br>I love just strolling in here randomly at all hours. I never feel the need to buy all my groceries at once anymore. Whenever I need something for a quick meal, I just pop on over to this place for a breath of fresh air and the experience is always pleasant and makes me so wonderfully happy to live here.",
