"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/krxz34OylsZXKn1VFc25cQ/l.jpg",
"rating":"4.0",
"reviewcomment":"San Francisco has a history of serious chocolate and the competition is intense. <br><br>See&#39;s promotes itself as an old-fashioned candy shop but their chocolates are of the moment, delicious, and addictive. The chocolate used is Guittard, smooth, luscious, and tasting and smelling of fresh chocolate.The variety is extensive, ranging from fresh fruit flavors, crisp nuts, and smooth truffle filings to decadent coconut and caramels.<br><br>Being able to select individual pieces to create combinations for myself and gifts is wonderful and the gift wrapping is free.Yes, everyone is offered a full-size free sample and if you prefer something other than the flavor of the day, your request is usually accommodated. Their chocolate chips, black licorice, and bon bons are also delicious.<br><br>All of the shops I have visited have been immaculate and tidy plus the staff really knows their inventory.<br><br>Wonderful to see they now offer specialty dark chocolate as well as fun and attractive packaging for a number of holidays.<br><br>Hard to believe they manage to be successful and the chocolates are still less than $20/pound. Take that you waxy Godiva, pedestrian Russell Stover, and $45/lb. Recchiuti!",
