"reviewcomment":"I do not typically like chain bakeries or cafes.  But I love La Boulange and today for the first time went for lunch to the one on Polk.  (Usually we go to the Columbus location closer to where my son lives.) So today my husband and I took 2 friends to the Polk location since we were going to a gallery down the street.  He ordered the Onion Soup and it was delicious.  Best I have tasted.  My sandwich was great.  My friends loved their club sandwich. <br><br>I find La Boulange&#39;s cafe au laits  the best in SF -- and this is saying a lot in a city full of great cafes. But the icing on the cake is that when we returned a hour later to buy some bread to take home, Christina (one of the managers) prepared a small tuna melt (and then cut it into 4&#39;s) so my friends and I could taste it.  It was amazing and so is she!<br><br>Next visit to SF, I will be back to the Polk location for a tuna melt and cup of onion soup. OH, and did I mention their Congolais?  I bought a bag for our group of 4 to share after lunch.  Exceptionnel!!!",
