"rating":"4.5",
"reviewcomment":"I first stepped into a Coffee Bean on a recent trip to Las Vegas, and was impressed with the quality of their ice blended coffees; in fact, their Pumpkin Spice ice blended coffee was the best of the many coffees I had during vacation there.<br><br>Researching them a little more on the web, I found out they were not some small independent, but in fact the oldest and largest private specialty coffee and tea retailer in the U.S., celebrating their 50th anniversary in business this year. Although they are huge in Southern California, and interestingly, overseas in Asia, they only have four coffee shops in Northern California, three of these in San Francisco. So this small Coffee Bean in the Embarcadero Center is actually the tip of a very large coffee iceberg!<br><br>Like the couple Coffee Beans I visited in Las Vegas, the Embarcadero Center shop is small, comfy and friendly. There are a decent amount of places to sit, as well as a few tables outside. And of course, being in the Embarcadero Center, you&#39;ll never find a shortage of places to sit and watch the people.<br><br>I ordered one of their holiday special drinks, a Toffee Nut ice blended coffee. It was delicious, and a unique flavor I haven&#39;t seen elsewhere. Although it was November, the weather was still pleasant enough to sit outside and watch the comings and goings of everyone while sipping my coffee. All in all, a delightful coffee break.<br><br>Now that I know it&#39;s here, I&#39;ll make a point of visiting the Coffee Bean when I&#39;m in the area.",
