"rating":"4.5",
"reviewcomment":"Elaine Y. basically took the words out of my mouth. New favorite corner café.<br><br>As someone who lives just a block from Velo Rouge, the fact that I&#39;m willing to walk ten times as far to go to Fifty/Fifty says a lot. I love Velo Rouge, but sometimes a girl gets tired of Blue Bottle. There. I said it.<br><br>Fifty/Fifty serves Ritual coffee, and the people who work there are so nice that they make me want to cry out of happiness/relief. It&#39;s really fascinating that it&#39;s actually possible to be a friendly, charming person AND make a delicious cappuccino. I thought that you had to be rude/aloof/busy-reading-pretentious-literature-­behind-the-counter to even stand within five feet of an espresso machine. I was wrong.<br><br>I&#39;m also delighted because they have matcha lattes. I used to depend on Flywheel on Stanyan for that business, but eventually they took it off their menu and disappointed me forever. Fifty/Fifty has them, so my life is beginning to get back on track.<br><br>Also... They sell Dynamo Donuts. These donuts have gone from being a biannual treat to a weekly one. On second thought, maybe that&#39;s a bad thing...?<br><br>AND you get all of this in a bright, clean space that&#39;s attractive without being overwrought or super trendy. Just comfortable and lovely.",
