"rating":"4.0",
"reviewcomment":"I knew this placed existed and would check em bc theyre nxt to walgreen&#39;s. Instead of buyin my usual I came here bc when golden gate bakery closes for vacation, theyre gone 3-4 weeks. Mee mee bakery has satisified my needs for cow ear snacks, chewey pork cookies, and loh poh beng (winter melon cakes, old wife&#39;s cake). The WM cakes are thick and heavy. Good flavor and reasonably priced at $2. The 2nd item I purchased was the pork chewy cookies. Theyre fattening and delicious though. Probably has lard,  but what has lard that doesnt taste good? Theyre the rite thickness so u dont pull any cavity fillings out.<br>They make the best cow ear snack crackers!! Pricey at $4 a bag, makes u wanna stretch em ovr a week. (I lapsed and finished a bag in an hour). I&#39;m weak. Forgive me.<br><br>i&#39;ve edited the review. i returned the following day (yup forgot to check-in AGAIN). my co-worker requested some loh poh beng. $2 each but they fit jus nicely in a small square plastic container that they packed em in. the owner scotch taped it so it wouldnt pop open (and deterred me from jacking one).<br>i also upped MMB from 4 stars to 5 STARS<br>so u can tell, I HIGHLY RECOMMEND THIS BAKERY. it has some old school yummy items (read as, stuff still made of lard, which makes the pastry flakey and delicious)",
