"categorystrlist":"Specialty Food",
"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/EtaKMg5DZnr3tT9dNHypXQ/l.jpg",
"rating":"5.0",
"reviewcomment":"Dining In -- I LOVE YOU!<br><br>What is not to LOVE about this service?<br><br>The food is delicious, gourmet, local &amp; fresh<br>They deliver it to your home or office<br>The staff is extremely helpful/nice/accommodating<br>Calorie counts on everything (all entrees are under 500 calories anyways)<br>Takes a max of 3-4 minutes to warm anything up<br><br>Basically the deal here is .... a menu is prepared on a weekly basis by a fantastic chef, they tailor it to your needs or preferences (allergies, diet, vegetarian, etc) - include calorie counts on all of the meals, and then you order by the Tuesday of that week.<br><br>Then... they deliver it to you. You can be home, or not home. In my case, they go in and load up my refrigerator every Monday while I&#39;m @ work and then I come home to amazing goodness that I don&#39;t have to slave over! They can also leave a thermal cooler if you prefer. Then you have a week of seriously AMAZING &amp; gourmet meals with no sneaky additives or high sodium (read: frozen meals) and they deliver again the next week and pick up the containers that you used the previous week. Isn&#39;t that great?! They are even eco-friendly as well! If you prefer to have disposable &amp; recyclable containers, you can request them- no problem.<br><br>Dining In has changed my life and after work regimen (THANK YOU) -- and I would wholeheartedly recommend their meals to anyone! <br><br>Some of my all time faves are:<br>Shepherd&#39;s Pie<br>Greek Platter<br>Honey mustard pan fried chicken<br>Chicken paprikash<br>Braised short ribs<br>Wasabi &amp; Panko crusted pork<br>Turkey Meatloaf<br>Oso Bucco<br>Crab cakes<br>Gnocchi<br>Chocolate Chai Cake<br>Strawberry shortcake",
