"rating":"5.0",
"reviewcomment":"We just used Drink for our 100 person wedding at the Log Cabin in the Presidio and they could not have done a better job. From the beginning Melissa was great about answering our questions and replying to our emails in an extremely timely fashion. <br><br>As far as the drinks go--they were amazing. We went with 3 signature cocktails and I would describe them here if only I could remember the details. Since I can&#39;t, I&#39;m sure I won&#39;t do them justice so I&#39;ll just say that they were amazing and that everyone loved them. They all tasted wonderful and looked great too--one of the drinks came with a flower and they lasted all night. They stocked top shelf liquor and poured all we wanted. One of my friends, after forgetting the name of the signature cocktail featuring bourbon asked for &#34;one of those bourbon drinks&#34; and received an entire glass of Maker&#39;s Mark. Needless to say, he loved our wedding. <br><br>The bar they set up looked beautiful and they never ran out of anything.  Anything we asked for they gave us and were as sweet as could be while serving us.  I really can&#39;t say enough about the staff at Drink. <br><br>We were slightly concerned because we only had an hour after the end of the event to be out of the venue but the had everything packed up and out on time. They worked very well with our caterers and overall we couldn&#39;t be happier that we booked them. I would highly recommend Drink to anyone seeking interesting drinks and great service.",
