"reviewcomment":"I adore project juice. The product is the best I&#39;ve tired in the bay area. I definitely haven&#39;t gotten to all of the various juice companies, but I can say that Project Juice has the best flavor, smoothest consistency, and most unique combinations out there. <br><br>I adore the mylks they offer. Turmeric, Get Up and Go Go, Mint Chip Shake- they&#39;re all amazing.<br><br>The juices: Clean Green, Dr. Green Plus, EZ Green Plus, Immunity, Master, Swizz Beets-- SO SO good. I don&#39;t like super sweet juices and they have a great variety of not so sweet, not sweet at all, and sweet if you want it. I find myself craving these juices every three or so days. It&#39;s amazing and terrible at the same time- Love it.<br><br>On a more serious note, I have an autoimmune disease that really inhibits the things I can eat. I&#39;ve found that Project Juice gives me the veggies I am lacking often in my diet because I can&#39;t digest them very well. My skin has improved and my digestion is less interrupted now that I incorporate juice in my diet. <br><br>On top of that, yes it&#39;s pricy. But, not at all unreasonably so. All organic, cold pressed, unique- it&#39;s going to cost you money. It&#39;s worth it. Bottom line.",
