"rating":"4.0",
"reviewcomment":"I LOVE this place! No really, every time I go to Japan Town, this place is a must. I&#39;m not even sure what attracts me here - perhaps it&#39;s the fresh sushi, the little boxed lunches, the aisles upon aisles of snacks, or what.<br><br>Granted the place may seem a bit cluttered, you&#39;re sure to find a gem here and there. Personally for me, I love coming here because I feel a bit nostalgic while I walk down the snack aisles. In fact, I&#39;d occasionally stumble on a snack that I haven&#39;t seen since I was a kid and buy a handful of different goodies. <br><br>You may think that&#39;s good, but there&#39;s something even better. When you walk through the big automatic doors to enter Nijiya, you should look to the right at the open fridge area. There you will find an assortment of Japanese lunches and snacks. The best part is that I was told that everything is made the day of so you can expect quality and freshness. The fridge stretches for a good length of the wall, so don&#39;t miss out on the takoyaki or croquettes in the smaller area. <br><br>Overall, great pit stop to get a quick snack. I recommend trying something you&#39;ve never seen before or perhaps buy a box of snacks that you can&#39;t even read. You never know if you&#39;ll stumble upon your new favorite snack!",
