"reviewcomment":"This shop carries bite-size chocolate covered gelatos - similar to mini-bonbons -  and is definitely a must try! These gelato pieces are individually wrapped pieces which is nice for snacking as compared to a large dessert, and there are almost a dozen flavors to choose from. I liked orange, pistacchio and basic vanilla. Each piece is not cheap so you&#39;ll have to splurge a bit for the goodness.<br><br>Recommended if you need to quickly grab a dessert snack on your way to a party/event. I reckon a pack of 32-pcs is good for a party of two dozen. And, if not eaten within a couple of hours, they will give you a double layered bag with dry ice to take the goods with you. Or you can stay as this has a feel of a small ice cream shop.<br><br>The place is right off Third St and Harrison and is not hard to find. I don&#39;t know of any other place like it! Too bad their hours are limited (MON to FRI from 1pm to 5 pm).",
