"reviewcomment":"Marble cake! I DREAM about the marble cake at this bakery.<br><br> I find the bakery booth at Vallejo Kaiser market on Friday and Walnut Creek market on Sunday.<br> I arrange my schedule so I can go and get some cake.<br><br>The oatmeal cookies and chocolate chip cookies are THE BEST! Moist inside with crisp exterior and they taste wonderful!<br>Their whole grain sourdough bread is fabulous! I try to pick something different (selection is huge) but I can&#39;t seem to get past the marble cake.<br><br> The young men who wait on customers are polite and helpful. The lack of signs and ID on their tent adds to the wonderful-ness of biting into the &#34;unknown&#34; pastry for the first time. &#34;Who are these bakers and why are there so many people in line?&#34; <br><br>You&#39;ll be back next week.<br><br>Thank you for the Vallejo market access. We in Solano county like wonderful baked goods, just like San Franciscans. With Crepe and Brioche we got it!",
