"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/qFrh4U8WLalpc5tmlht2Ww/l.jpg",
"rating":"4.0",
"reviewcomment":"My friend and I stumbled upon this joint by chance (overdue review, came here July of 2013), convinced to go in by a woman with a GIANT falafel plate sitting at the window. We were hungry, and it looked good, so why not? In the end, I&#39;m really glad that we took the chance to hit up the Blue Front Cafe. We chatted with the owner of the store, who took our order. He said his name was Peter, but after further questioning he admitted that it wasn&#39;t his real name (LOL) and he just said his name was so because his real one was too hard to pronounce. (We tried. He was right.)<br><br>I settled for a falafel wrap, wondering why most of the items on the menu were around $10~... and I got my answer when my order arrived. The portion was HUGE. HOLY cow, I&#39;d say it was a little bigger than your average Chipotle burrito! So in terms of the price to size ratio, I&#39;d say things evened out rather nicely.<br><br>But then things got even better. I took a bite of this gentle giant of a wrap, neatly diagonally cut, and the taste was superb! Really fresh, and I actually really liked the fact that the falafel was a bit warm. The contrast in temperatures played off really well on my palate. <br><br>In terms of ambiance, it&#39;s your average cafe -- order at the front, your order comes, and you eat. What I&#39;d like to try next time is their breakfast items/coffee. The menu, posted on a gigantic blackboard behind the order/deli counter, was pretty overwhelming.<br><br>This place was a definitely a pleasant surprise. Will go back if I ever have the chance!",
