"reviewcomment":"Erik/Fat Alley catered a recent big family dinner for us and thanks to his great pre-event communication and preparation and day-of work, our guests had a great time going back for seconds of the steady stream of tasty dishes.<br><br>Erik suggested the menu and worked on finessing it with me to accomodate our various dietary restrictions and budget. <br><br>The Menu:<br><br>vegan gumbo: chock-full of flavor, thick, perfect texture<br>carnivorous gumbo: rich and flavorful, hearty, not too mild, hint of smokiness, tasty sausage<br>fried chicken: fresh and hot!<br>couscous salad: my dad was especially impressed with this<br>&#34;the world&#39;s best tofu&#34;: marinated chewy slices - I&#39;m so looking forward to making a sandwich of the leftovers tomorrow!<br>mixed green salad: local, fresh, tasty (I had two platefuls) with an amazing fruity dressing<br>fruit salad with housemade remoulade<br><br>We had a highly enjoyable time and recommend Erik/Fat Alley for your next get-together",
