"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/cjYXKieyAjlbJnuGIcf4lQ/l.jpg",
"rating":"4.5",
"reviewcomment":"This is the perfect pie!  For all of you, pot pie seekers, your quest is over.  These individual hand held pies are fantastic!  Each one is wrapped in plastic and comes in a paper sleeve with heating instructions.  You can  <br>pick up these pies at the farmer&#39;s market at the Stonestown Galleria on Sundays.<br><br>Trust me, I know the anticipation sucks when you&#39;re hungry.  After 10min in the oven you&#39;re rewarded as the crust browns and it&#39;s ready to eat.  The pie crust is golden, flaky, and buttery as a croissant...perfection!  You could put any filling in this crust and it&#39;ll taste so good.  Luckily, the filling choices are also amazing.  All are excellent but my favorites are:<br><br>Butter Chicken- big moist chunks of chicken with an Indian flair<br><br>Lamb Curry- Moist, tender lamb in a savory sauce<br><br>Chicken Vegetable- chicken, carrots, broccoli...traditional comfort food!<br><br>I&#39;ve been wanting to try these pies for awhile now.  With the rainy weekend, these pies were a great excuse to leave the house.  Again, these amazing little pies with have the greatest pastry crust ever.  I sure wish the owner opens a store front so I can get these hot over the counter!",
