"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/feDZWWh8-kWMusem1Az8-Q/l.jpg",
"rating":"4.5",
"reviewcomment":"Amawele surely cooks up some great smelling South African, spiced-up foods from their kitchen!<br><br>Frikadella - Warmly served out smothered with creamy, spicy orange sauce and packed with grounded beef that were stuffed with grilled onions and fries, in a sandwich bun, this was mouth-watering delicious!<br><br>Cape Malay Rice Bobotie - Their minced beef, mixed vegetables, a toss of raisins and well seasoned and spiced up rice, is so heartwarmingly fulfilling.  I believe the smell of this dish that is cooking, is what lures customers, such as myself, during the lunch hunt, to come here!  I love this entree the most!<br><br>Bunny Chow - I ordered it up as chicken for the meat option.  The concept is like clam chowder, but curry chowder!  The chicken curry was stuffed in a hollow bread bowl and the curry sauce was good.  I would avoid this dish for lunch, personally, because curry gives me food coma and I am super unproductive when that happens!  I do recommend to go early for lunch, to get this dish because they sell out quickly and don&#39;t restock!<br><br>Their entrees are reasonably priced about $10.  The owners are the chefs as well!  They are super friendly and personable!<br><br>The smell of spices that this kitchen exudes, is undeniable!",
