"rating":"4.0",
"reviewcomment":"THIS is the cupcake you&#39;ve always dreamed about.<br><br>I&#39;ve tried them all...Sprinkles, Kara&#39;s, SusieCakes, Blissful Bites, Sweet Things etc. I prefer Sift over all of them (although I love Kara&#39;s as well) But Sift takes the cake ;)<br><br>The cake is dense and moist. The frosting is plentiful, rich and perfect. I&#39;m a frosting whore.  So to me, there&#39;s no such thing as &#34;the frosting is too sweet&#34; BS.<br><br>My favorites:<br><br>Vanilla. I&#39;m a simple girl and all I ask for in life is a perfect vanilla cupcake. Sift has it!<br>Samoa. Genius. PURE GENIUS.<br>Snickerdoodle. I love everything cinnamon.<br><br>Ok, now this next part I&#39;m going to tell you is life changing. The cherry on top to make these cupcakes THAT MUCH BETTER. If you have the will-power to wait until you get home to devour one of these treasures, pop it into the microwave for 8 SECONDS! NO MORE, NO LESS! It&#39;ll come out soft and just a tad bit melty and you will never look at a cupcake the same way again. <br><br>You&#39;re welcome.",
