"reviewcomment":"Five stars for this cash-only Japanese food truck. I swear, every Thursday my entire team at work comes here for lunch. Every single Thursday, and we pretty much get the same thing every time too. It&#39;s that good.<br><br>The line can be long around noon, but we&#39;ve also gone at 11 or 1 and there&#39;s typically no line. If you want a bento box, you can skip the line and order right away but I&#39;ve never gotten one so I can&#39;t really vouch for that. The chicken katsu curry is my staple here.<br><br>This is also a great place if you like your food spicy. You can specify the spice level by telling them the number of &#34;S&#34; you want in your food, like &#34;Chicken Katsu Curry 4S&#34;. The highest I&#39;ve seen anyone get is 8S, but I&#39;m totally a spice wimp so I&#39;ve never gone higher than 4S. If you just say &#34;spicy&#34; they&#39;ll give you 1S, so be more specific if you want your food spicy!<br><br>If you don&#39;t like spicy food, don&#39;t worry! Just tell them that and you can still enjoy the delicious Japanese curry.",
