"reviewcomment":"Giving up coffee has been one of the hardest things I&#39;ve done for the sake of my health. To compensate, I&#39;ve been cultivating my taste in tea.<br><br>As fortune would have it, I was given some Red Circle Teas as gifts: Gold Medal Jasmine Green Pearls, Ying De Red, and White Leaf Dan Chong Oolong. <br><br>They have all been exquisite - delicate flavors without bitterness, even with longer steeping (as I like to do sometimes,  to get all the medicinal benefits. Or other times I just forget and wander away from my cup). I steep each serving at least three times to get the most out of it, because I know these are precious specimens!<br><br>The White Leaf Dan Chong Oolong is particularly delicious - floral, complex. <br>And best of all no coffee-like side effects, even if tea does have caffeine.<br><br>I haven&#39;t been to their tastings yet - I live in the East Bay and don&#39;t get to the Mission often.  But if I had the chance I would jump on it.",
