"reviewcomment":"The last time we used Jennifer was for our daughters wedding at the end of 2012. So when my friend was turning 60 this past April and her daughters (who were coming in from out of the country to celebrate) asked me about where they could get a good cake, I did not hesitate to recommend Beyond Buttercream.<br><br>Aye, but here was  the rub. The birthday girl has severe lactose intolerance. What did Jennifer say? No problem! She said she&#39;d make a devil&#39;s food cake with raspberry preserves in the middle, and  she came up with a delicious dairy free frosting!<br><br>The birthday girl lived much of her life in the Northern Mariana Islands so they wanted a tropical themed cake and something to represent her 10 grandchildren.<br><br>Jennifer placed beautiful and elegant pearlized shells along the bottom of the cake and then she made 10 beautiful plumeria flowers and placed a &#34;pearl&#34; inside each to represent the grand babies. It was just beautiful.<br><br>And the taste was just perfect! It was moist and delicious and we had many compliments on our choice of cake makers!<br><br>I still highly recommend Jennifer and and waiting for the next occasion when I can use her . . .",
