"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/JPy9YXNkMtGogMQN_xlv8Q/l.jpg",
"rating":"4.0",
"reviewcomment":"Oh this place soothed my soul just right, a perfect wide windowed stone and wood space with beautiful, warm delicate Sight Glass coffee and a few taps of SF beer, Magnolia and Sudwork, and simple, fresh tasty food. Non-snobby staff who chatted easily with each person who came in no matter how third wave savvy their coffee order. Behind the counter they talked excitedly about ideas for future dishes and events.<br><br>This cafe is a short walk from the Haight in a cool, residential area with a few other bars and shops, but none of the touristy bustle. Maybe it was because the sun came out and the fog burned off while I was here but this was the moment I began to feel like SF was a place I could love and live in. I get bummed and freaked here sometimes by the heartbreaking poverty and nauseating gulf between rich and poor, but that&#39;s when I have spent too long in the financial or touristy sectors. Getting out to a real neighbourhood where food and drink are served with a love for local and a quiet mellow sunny rhythm heals all, always.",
