"rating":"5.0",
"reviewcomment":"My wedding cake tasted as amazing as it looked!<br>As a last minute notice, I looked around for a wedding cake vendor who was skilled, flexible and communicative in our last-minute look-around for wedding cake vendors. Mimi was very easy to communicate with, and she asked all the right questions to make our cake special for our big day. With a number of ideas we brought to her, we went with her recommendations that conformed to our requests. Sure enough, the cake looked classy, elegant and beautiful.  Our wedding was on July 4th, and it had a navy blue ribbon on the base of each tier, with white chocolate frosting and red rose petals - a perfect red white and blue  theme that was sophisticated, minimalist and classy.<br>On top of that, the cake was delicious. She knew that I didn&#39;t like cakes that are too sweet, and it was good to hear she thinks the same. We had a chiffon cake with mango filling - it was perfect! <br><br>Thank you Mimi for helping to make our day memorable and special, and thank you for all the effort you put into your work.",
