"rating":"4.0",
"reviewcomment":"&#34;Here you go, you still like Sharon Stone right?&#34; my aging mother says, handing me Shape magazine with Sharon Stone on the cover for all the patrons to see.<br><br>I blush, fold the magazine, and tuck it under my arm.<br><br>My mother is meeting me downtown for lunch, and though she loves High Tea when we go here, we were too early (it starts at 2:30pm) so we settled for their 2 lobster bisque&#39;s and 2 lobster clubs.<br><br>And an endless amount of popovers with strawberry jam. &#34;Keep &#39;em coming,&#34; my mother tells the waiter, as I politely tell my mother that I&#39;m not into Sharon Stone anymore. That was when I was a teenager, but I&#39;ve grown up since then.<br><br>&#34;Oh, who&#39;s in now then? Who do you young people like? Heidi Klum?&#34;<br><br>&#34;Goodness no,&#34; I said. &#34;Julianne Moore,&#34; I whisper, though I&#39;m not sure why I&#39;m whispering.<br><br>&#34;Don&#39;t know her,&#34; my mother says as we chow down on some great soup and sandwiches. The atmosphere is always nice here, and the view, when you can get a window overlooking downtown only adds to the experience. &#34;You can give me back the magazine since you don&#39;t like Sharon Stone anymore,&#34; my mother adds.<br><br>&#34;That&#39;s okay...I&#39;ll keep it,&#34; I said tucking it behind my chair. I wasn&#39;t ready to let go of the magazine or the great dining experience of this place.<br><br>Minus 1 star for hit or miss service during the nearly 20x I&#39;ve been here.<br><br>**Just a note that high tea offers a great selection of small sandwiches, a tea of your choice, and great desserts; I like high tea more than I do their lunch***",
