"rating":"4.0",
"reviewcomment":"The city view, the rooftop deck, the coffee... this is a small slice of heaven nestled on top floor of the San Francisco MoMA. Whether you come just for the coffee or want a place to unwind after a day at the galleries, I&#39;d recommend this to anyone visiting the area!<br><br>I ordered a cappuccino. I added a little bit of sugar but it was honestly creamy enough to drink straight. I wish I ordered the mondrian or damien heist dot cakes, too cute! #artnerd Only complaint is it is a bit pricey and I do believe this locations prices a little more than the ferry market building (may be wrong) Though I thought the service was better here (the market building had a bit of pretentious hipster attitude) <br><br>The atmosphere is what makes this location prime. There is an indoor space where light floods in from all directions thanks to the glass walls. There are two courtyard spaces where you can chill by the sculptures and enjoy a view of the skyscrapers around. I&#39;d love to spend a saturday working away here.<br><br>note: this BBC location is dine-in only. so if you are looking to take your coffee to go, consider bringing your own travel mug and see if they comply :P",
