"rating":"4.0",
"reviewcomment":"When I moved in down the street I made note of the cleverly decorated cafe (there&#39;s a red bike that rests above the door to match its name). But, I when I finally made it down there I knew it would become a second home. <br><br>On my virgin voyage here, I had ordered a coffee and a toasted whole wheat bagel. I know myself to be overly eager and burn myself drinking coffee on the regular, so I went to town on the bagel first. Honestly, I&#39;m not sure what the fuck kind of cream cheese they use, but it was like a creamy heaven in my mouth (yes... I know). I mourned its end for a moment and I nearly forgot about my coffee. Then came the second &#34;wow&#34; of my visit. I had wondered why my coffee took so long, but after taking a sip and looking back towards the register, I saw the Blue Bottle logo. Skipping the long winded praise, it was awesome.<br><br>Since then, I have gone there an embarrassing amount of times in a short time period. There&#39;s a great mix of people of who come through here, which is great for people watching while I get some work done. Also, despite it being seemingly crowded all the time, I haven&#39;t had any trouble getting a spot. The staff are extremely friendly, something I can&#39;t understand when they are so busy. <br><br>I&#39;d recommend this place to people passing through, but please don&#39;t come here often... I want  a place to sit.",
