"reviewcomment":"we were all set to go to Mitchell&#39;s and we were there and got a ticket but none of their flavors excited us. so we drove and drove and ended up at Swensens. this is our 2nd time at this swensens, the first time we jumped off a slowly moving trolley after a stop, this time we just hopped out of our car. <br><br>the first time i asked them if they made a sundae called strawberry stripes and they said no. so what did i ask them again this time around, same answer with &#34;that&#39;s from our chains&#34;. 1999 hyde street is the original Swensens and unlike original Starbucks on 1912 pikes place they didn&#39;t adopt their chains menu. <br><br>i still ordered a strawberry stripes sundae and their strawberry bar none is the best ever. its strawberry ice cream with hot fudge a little strawberry sauce, whip cream, nuts and a cherry, equals killer. the wife had their scoop of swiss orange chip which was also killer.<br><br>again things happen for a reason. mitchells we were in bernal heights, swensens you are two blocks away from the top of lombard street to your right, and up and down is alcatraz. we sat at a shaded stoop with killer ice cream, while looking at three SF landmarks. three? every 5 minutes a trolley would pass us.",
