"rating":"4.0",
"reviewcomment":"I live across the street from Christa Wonderful Market and it is pretty sweet.  I&#39;ve lived across from a few liquor stores/markets in my day and I&#39;ve never felt any loyalty to them.  My, how things change.  George is the man.  He doesn&#39;t ever remember me and gets very upset when I ask him to make me a sandwich but I&#39;ve seen so many people go in there and thank George for:<br><br>changing a tire<br>letting them use the phone<br>watching their laundry<br>calling a tow truck<br><br>I&#39;ve even seen a girl go in there and almost cry because she felt such gratitude for George and then they embraced.  I don&#39;t know what he did for her but I started to love George after that.  George also stands outside on cold nights and shouts Arabic into the phone and I can hear him from my apartment.  When he looks up and sees me in the window I usually wave but he has no idea who I am.  Good times.",
