"reviewcomment":"STARVING and stuck in bs Golden Gate Bridge traffic - seriously - like 3 hours just to go from SF to Santa rosa the wknd they closed down the bay bridge.  I had a crying restless 2 year old in the back, a nagging wife in the back and music stations that wouldn&#39;t play my Brittany spears...seriously WTH!!  I thought I left early enough to beat the traffic to make my friend bday party, but obviously there are smarter people than me in the bay area...jam packed!  I was starving after I realized I wouldn&#39;t make it in time for the BBQ lighting...and the two year old ate all his snacks (which yes, I do try to sneak in a bite here or there).  Anyhow, I saw this bread truck in front of me.  So I went over to him with cash in hand, begging for a crumb or something he could have spared.  The guy gave a whole bag of they delectable break sticks...they saved my life!!  Seriously!  And I guess he felt bad for me because he just understood my situation he probably heard the nagging wife or the crying kid)....but had he not given them to me, I dont think I would have made it over the GG bridge.  Its because of them, I live to see another day!  Awesome",
