"reviewcomment":"Probably one of the best tents you can visit at Off The Grid Fort Mason for the 2013 season has to be Bok Ssam and their Korean fusion comfort food.<br><br>They only have two items on their menu.  And both are really awesome!<br><br>The first dish is their Korean BBQ Wrap.  Unfortunately I don&#39;t have a pic of this, but think of it as an oversized Vietnamese Spring Roll with Bulgogi Beef and Noodles and sweet sauce.  It&#39;s pretty damn good!  <br><br>The other dish is pretty much the real reason why you must try Bok Ssam.  <br>Korean Fried Chicken and Waffle Sandwich -- <a href='/redir?url=http%3A%2F%2Fbit.ly%2F14mFwnw&amp;s=0e80faedc7e6fa7384139f3202793cb344be5411266cb891630f5fe44b914e30' target='_blank' rel='nofollow'>bit.ly/14mFwnw</a><br>Oh man, this is soooooo gooooood!!  It&#39;s OMGYUM!!  I&#39;ve been to other places that have their own take on the Chicken and Waffle Sandwich, but I think Bok Ssam makes the best version of it.  The Waffles are cooked perfectly where they aren&#39;t too hard and have a nice chew to them.  They hold together nicely with the nice sweet and spicy fried chicken with the same sauce at the Korean BBQ Wrap.  It&#39;s so effin&#39; good!!!<br><br>So that&#39;s Bok Ssam.  Delicious Korean American Comfort Food.  I really hope they go and sell their food at other locations soon.  They have a really good thing going on with their two entrees. You definitely should make the trip out to OTG Fort Mason and try them out!  It&#39;ll be worth it!!",
