"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/awZ6iBq5oHbYDMdBoe9zpw/l.jpg",
"rating":"4.5",
"reviewcomment":"I&#39;ve been on this green tea latte craze as of late, so I&#39;m trying them e v e r y w h e r e :D <br><br>I decided to give this place a try since I saw good reviews, and boy, oh boyyyyyyyy, I&#39;m soooooo glad I did!<br><br>On a gloomy Wednesday San Francisco morning, I dragged my feet into Antigua feeling tired and in dire need of some caffeine for this humpity-humpy hump day.  Greeted with a GENUINE smile by the barista/cashier, I ordered a large green tea latte with almond milk (LOVE how they have this as an option). I also got a cookie for my 1.5-year-old coffee date (before you ask, I&#39;m a nanny!). <br>As I waited, my date gobbled the cookie up and thoroughly enjoyed it!<br>It wasn&#39;t long before I got my latte &amp; I was headed for the counter to add some sweetener (because I usually have to adjust lattes to my taste), but I took a sip and my eyes lit up, the clouds parted for the sun to shine through, &amp; I&#39;m pretty sure I heard some magical chimes for a second...<br><br>It was just the right sweetness that I didn&#39;t need to add anything or feel like I&#39;d get a toothache &amp; just the right temperature that I didn&#39;t burn my tongue on that first sip. It was amazing! I might just have to stop going around town to try every place because I know Antigua won&#39;t disappoint! <br><br>I happily skipped out of the shop with my date yelling &#34;Byeeee!&#34; to the kind barista with a genuine smile on MY face now because my hump day got a little less humpy thanks to Antigua! I&#39;ll DEFINITELY be back! ^__^",
