"reviewcomment":"Peet&#39;s is not just a Fillmore St. coffee shop. It&#39;s the social hub of the neighborhood.<br>This place is always hoppin&#39;. The coffee&#39;s always brewing; the lines are long; and all their outdoor tables are full with regulars.<br><br>It&#39;s understandable because they serve a good product. Unlike other coffee chains (ahem, Starbucks), Peet&#39;s brews some damn fine coffee. And make no mistake, this coffee is STRONG (like Red Bull strong). So consider yourself warned.<br><br>Peet&#39;s also offers a selection of teas, sweets, and other goodies. I would come here more often, but the place is just too damn crowded. That&#39;s obviously no fault of Peet&#39;s. They&#39;re just a victim of their own success.<br><br>For the record, Peet&#39;s is an excellent member of the community. They&#39;ve donated coffee to my niece and nephew&#39;s school on numerous occasions.",
