"reviewcomment":"I&#39;ve read some reviews here about fruit flies on the food. I don&#39;t know if this problem has been resolved yet, but I&#39;ve seen signs for management/supervisor positions opening and then soon those signs were gone. Maybe there has been a change of management?<br><br>You also have to consider that despite how many people go here every day, there are only 80 reviews for this place. It&#39;s because no one really has time to review it, + there&#39;s probably no point in reviewing it because it&#39;s not super great, it&#39;s not terrible, and everyone would probably have a similar review of the place.<br><br>Peets is Peets. It&#39;s good. Maybe a bit realistically overpriced, but with people going here almost every day it&#39;s not seen as being overpriced.<br>I have coworkers that go here every morning and the baristas already know exactly what to get him.<br><br>They deal with a lot of customers per day, have nice baristas that know what they&#39;re doing, and they get your orders out fast and accurately.<br><br>Every time I have been here I haven&#39;t had a problem. It&#39;s a 1 minute walk from my office, which is closer than the 2 minute walk to Starbucks.<br><br>Even when the line has 10 people in it, it goes by really fast because they&#39;re really super-efficient with their orders.<br><br>This is a quality Peets establishment with great working wifi that I use all the time.<br><br>Until I find something wrong with this place personally, 5 stars for me.",
