"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/QLIy5efnJ1X7gS6FeNWTSQ/l.jpg",
"rating":"4.5",
"reviewcomment":"Overall 5 star establishment. Options were just about right compared to 2-page menu. Staff were very friendly and accommodating. The place is a little small with outdoor tables on the side walk with street parking only. Decor was inviting, although you felt like you were in Tin Man&#39;s house. The food was great!!! Even if the place was a dump and staff were rude, food alone deserves the 5 stars. <br><br>I had the Jake&#39;s Meal ( a 2 step meal choice) with Step 1: Choose your protein and Step 2: Choose your sauce, accompanied with Royal Rice Pilaf, Siracha House Slaw, and Chef&#39;s Salad with Citrus dressing. <br><br>I chose the Flashy Fried Chicken and Sweet &#39;n&#39; Tangy BBQ Sauce with a side of Mac &#39;n&#39; Cheese Sticks.<br><br>Food tasted fresh, energetic, portion appropriate, and healthy. I would come to Jake&#39;s Place for the Mac &#39;n&#39; cheese sticks alone. Thinking of the deep fried mac &#39;n&#39; cheese stick goodness makes me crave it. Price is what you would expect to pay for fresh ingredients.<br><br>Staff were very friendly. They were playing music I enjoyed so I walked over to their Jambox speaker and turned it up. I apologized for touching their belongings, but I was glad I did it since they accepted my poor boundaries and encouraged me to dance and enjoy the music with them as they handed me my food.<br><br>So to sum it up:<br>Pros:<br>Staff were very friendly<br>Food was tasty, fresh, clean, and good looking.<br><br>Cons: <br>Place is a little small and not good for groups.<br><br>Recommendations:<br>Order for pick up and get the mac &#39;n&#39; cheese sticks.",
