"reviewcomment":"I love the Juice Shop!<br><br>I originally wanted to write a review for the Corte Madera location, but it looks like the owners haven&#39;t activated the page yet. I&#39;ve been to this location as well, but I live in Marin so i&#39;m in the Corte Madera store more often.<br><br>Anyways, I&#39;m a big fan of fresh pressed juice. When i&#39;m not at the Juice Shop you might find me in my kitchen dancing around and prepping veggies for juice. Let me tell you though, juicing takes effort. You&#39;ve gotta wash the produce, chop it, rotate it so that it doesn&#39;t clog, strain it (celery and greens give way to much pulp!), clean the machine etc. I juice on a regular basis, but when I want to treat myself Juice Shop&#39;s got my back. <br><br>My favorite juice is the A+ Deep Greens. I&#39;ve attempted to get the seed smoothie many times, but they are almost always sold out!! I finally got last week in the early hours of the morning and it was very tasty. I also love that they give a deposit for the glass bottles! Awesome job Juice Shop. <br><br>At both locations the employees are always so friendly!! I&#39;ve met most of the brothers and you can definitely see how passionate they are about juicing and living a healthy lifestyle. Although its not cheap, this is definitely the kind of business I love to support.",
