"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/TGDBPiCaXA_Xe9DwwC872g/l.jpg",
"rating":"4.0",
"reviewcomment":"There aren&#39;t a lot of pizza joints where I work, so when I found out about Casey&#39;s Pizza, I was ecstatic!  Every Wednesday afternoon, Casey&#39;s is parked right on Sansome and California from 11am-2pm.  You can order a whole pie (6 slices) or a mini pie (4 slices) and have the thin crispy crust pie all to yourself.  Their standard pies are the Margherita, Zoe Pepperoni, and the Arugula.  They also have a special or two on rotation from week to week.  <br><br>The Margherita is definitely the best for me.  The Zoe is good, but after the first slice, it get&#39;s a little salty.  Also, if you go after 1:30pm, it&#39;s happy hour, so all pies are $1 off!  You can also order slices during happy hour if you just want to try a slice.  <br><br>Casey himself works on the truck and interacts with his patrons regularly.  He remembers peoples names and recognizes faces.  It&#39;s rare that you see the owner actually working on site, so you get a real sense that he really cares about his patrons and just loves what he does.  I must say, he seems like a pretty awesome dude.",
