"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/9iiyM9-Z4vxfoEa-inkMdQ/l.jpg",
"rating":"4.5",
"reviewcomment":"The boat leaves promptly from Pier 39 at its scheduled time so it is important not to be late. It is a smaller boat that has minimal seating inside and room for standing on the deck. The boat circles around the bay for about an hour and you can catch some beautiful views of the Bay Bridge, Alcatraz, AT&amp;T Park, and downtown SF while sipping on some good wine! Kevin drives the boat while his wife, Melissa, pours the wine and they are both sweethearts. You get 4 tastes per person(not including your welcome glass) and they provide a small assortment of cheese, bread, and crackers.<br><br>I had a really good time with friends and the wine was actually pretty good. They have bottles for sale just in case you happen to love it that much. The particular bottle that I chose was $20/$22. Wine tasting on the Bay is a great concept and such fun! I definitely recommend this activity for couples and groups of friends.",
