"rating":"4.5",
"reviewcomment":"I have two separate reviews of Phoebe that I will roll into one.<br><br>First, I took a few different &#34;group&#34; cooking classes with Phoebe as a work event and then with co-workers.  The events were mostly important fun, secondly she had us make food that we could realistically recreate on our own after, and third, she gave us hints along the way that were helpful for cooking in general.  After cooking, we would sit down at her table and eat together in a nice, cozy setting.  While her kitchen isn&#39;t enormous (it isn&#39;t small either), we didn&#39;t have any problems with the 10 or so people cooking there.<br><br>Separately, I asked her for personalized cooking lessons after that to help me with cooking quick, tasty, and nutritious meals for my daughter.  These sessions were absolutely wonderful as she taught me basic, intermediate, and more advanced cooking skills that I have continued to apply today.  I also go to sample a bunch of the foods she was cooking for her clients, which were delicious.<br><br>I&#39;m surprised to read a review below saying she wasn&#39;t particularly friendly.  I found Phoebe to be genuinely friendly at all the events - a nice contrast to the sort of fake &#34;I need to be super friendly because I&#39;m being paid&#34; mentality you can sometimes find.",
