"rating":"4.0",
"reviewcomment":"Five stars for the food. Service is always slow, unless you happen upon the lucky time of day when you are the only customer. They only ever have one or two people working the cash register/food prep, so plan on waiting a bit, it&#39;s worth it! <br><br>The bagels are the real deal, not just round bread like at other places. Just the right amount of chewy outside soft inside. <br><br>Bagel breakfast sandwiches are great, add some pastrami (and Tabasco), it&#39;s better than bacon (really!). <br><br>They&#39;ve also got a great selection of other pastries: cookies, sticky buns, hamantashen, bear claws. You&#39;ll be standing right next to the cases of them, staring as you wait to order. It&#39;s hard to resist a few impulse treats for later.<br><br>If you show up early enough in the day, the day old rack in the back has pastries in addition to half-price bagel dozens. <br><br>The coffee is hit or miss. It&#39;s not bad tasting, but if they&#39;re busy, they&#39;ll probably be empty. Decaf is a better bet. Coffee is directly to your left as you walk in. It&#39;s self serve, grab a cup while you wait in line.",
