"reviewcomment":"WOW just WOW.....I have lived in SF for almost 6 years now and my biggest complaint about this   city is how I really disliked the Mexican food here. I have been too many Mexican places that are &#34;amazing&#34; in and around SF, only to leave disappointed or unsatisfied. What I mean by disappointed or unsatisfied is a Carne asada burrito filled with rice and lettuce and a few pieces of asada or dropping $12 for a couple of ok tacos.<br><br>No longer do I have to deal with rice filled burritos. I can get my San Diego style Mexican food here in SF, and that makes me happy. I can get the fresh rolled tacos I love and miss. I can get my California burrito fix here. Thank you Fritas shack for coming to sf. Thank you for bringing your delicious food at a reasonable price to SF, and I look forward to seeing you soon.",
