"reviewcomment":"Thank you yelpers!  Once again, yelp helped me find something I would never know existed.  I came across this place before when I was yelping for shabu shabu places.  I never thought of yelping for actual shabu meat, bc I always bought shabu meat from Japanese grocery stores.  <br><br>We got invited to a hotpot dinner and we had to bring the meat.  I took the 30 bus got off at Stockton &amp; pacific and walked up a 1/2 block.  It doesn&#39;t look like much, but the old Chinese guy helped me and he even spoke English (which is surprising in Chinatown).  I told him I wanted 2 lbs of snowflake beef for hotpot.  He showed me the beef and weighed it in front of me before slicing it in the back.  He was super nice and the beef was great!  <br><br>Everyone said it was better than ranch99 beef, but the quality is probably inline with the Japanese grocery stores.  It&#39;s hard for me to judge without having both in front of me.  My guess is it&#39;s cheaper than nijya or suruki, but I&#39;ll have to check next time.  Overall, the beef and service were quality!",
