"reviewcomment":"Hooray! Peet&#39;s now offers ALMOND MILK LATTES. Currently you can CHECK-IN ON YELP and get $1 off any vanilla latte. If you opt in for Peet&#39;s electronic newsletters, you also frequently receive coupons via email. I recently got one for $2 off any size soy/almond milk vanilla latte and decided to give it a try. Delicious! The nutty flavor of almond milk goes really well with the vanilla, and I don&#39;t feel that extra sweet flavor that I taste in soy milk. <br><br>I like this particular location because it&#39;s right by my office. For some reason it doesn&#39;t get ridiculously crowded in mornings unlike Starbucks around the corner. If I need a breather from working at my cube, I often walk down for a quick break. There&#39;s also a few tables available if you want to eat lunch here too (usually I grab a bahn mi sandwich from Tart to Tart and come eat at Peet&#39;s). Additionally, there is no overwhelming background music if you want to do some work at this location--just the hum of espresso machines.<br><br>Tips:<br>+ Check-in via Yelp for a discount<br>+ Subscribe to online newsletter for more coupons/discounts<br>+ Try the almond milk vanilla latte<br><br>Things to note:<br>- Peet&#39;s tends to have a lower temp on drinks compared to Starbucks. Just ask them to make it extra hot if you prefer it.",
