"categorystrlist":"Flowers & Gifts,     Coffee & Tea,     Bookstores",
"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/k3wxaV-A5wLRTD64wiyvgg/l.jpg",
"rating":"4.0",
"reviewcomment":"We practically jogged to this place when we got to the Golden Gate. My small bladder had my husband and I in a panic, so we walked down the path to the restrooms--thank goodness those existed, since my &#34;waterlogged&#34; brain was thinking of all of the horrible things that could happen in that situation--and decided to get some coffee to warm up from the drippy fog and to relax from the distress. <br><br>The chai I had was pretty tasty (worth noting that both of our beverages were extremely hot, which isn&#39;t the best thing in the world, but it&#39;s better than cold!) and the chicken salad that we shared was also really good. I love chicken salad, but sometimes get turned off by extra creaminess and bad chicken. This was not the case, as we devoured our little lunch and continued to explore the rest of the day. <br><br>The items in the shop weren&#39;t anything too unusual or eye catching and what really didn&#39;t help was the fact that the place is very tiny, so there wasn&#39;t much room for the line at the counter, and especially limited room for browsing.",
