"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/q9DJp5Os7vARkQWS36UUFg/l.jpg",
"rating":"4.0",
"reviewcomment":"Right off the bat, I&#39;m a big fan of Simple Pleasures. I&#39;ve lived in San Francisco for a little over 17 years and I&#39;ve been going to this cafe for pretty much just as long. Want a cup of coffee and a bagel or pastry to start off your morning? They&#39;ve got that. Want some lunch in the afternoon as you study or catch up on work? They have that too. How &#39;bout some dinner after a long day? Hey, guess what, they&#39;ve got that covered as well! But it&#39;s not just about the food abnd drinks they have, it&#39;s the people who work there, the live music that&#39;s there 3-4 times a week, and the comfortable,  welcoming homey vibe  that they put forth.<br><br>San Francisco, like so many major cities in the US and around the world are filled with Starbucks&#39; and other big box coffee shops that all serve the same type of drinks, play the same types of music, and that practically look the same. Among all that sits Simple Pleasure in WAY Outer Richmond uneffected by the coffee gentrification and continuing to offer quality beverages, food, and what&#39;s essentially an extended living room for all those who&#39;s days can be made better by a beverage, a bite to eat, some live music, and some friendly conversations.<br><br>I love Simple Pleasures Cafe, and I think if you come on out and take a visit that you will too!",
