"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/-wb3V9SH2PervPOFjP0jVg/l.jpg",
"rating":"4.0",
"reviewcomment":"I would say this is the most popular and busiest of the Russian specialty market food stores in SF&#39;s &#34;Little Russia&#34; on Geary Blvd. - on weekends this place is packed. Their selection of meat and deli products are second to none. Large cases full of whatever you might be craving in the way of Eastern European specialties are in great abundance at New World.   <br><br>Fine caviar, sturgeon, interesting smoked/cured salmon - its all here.  Cheese blintzes and cherry blintzes, potato and mushroom vareniki are wonderful. <br><br>They have two different kinds of sauerkraut. One of them is just labeled sauerkraut and is very fresh, crispy and salty/tangy. The other is called Buriyski-style sauerkraut, also good. <br><br>Dark and light rye breads from &#34;The Bavarian Bread Company&#34; in San Leandro are always good (Russians in the Bay Area seem to love German bread) . <br><br>Pork and veal Pelmeni, Piroshki and many different kinds of fresh salads, all Russian style, are available every day, all the time. <br><br>I am not Russian, but two years with a lovely blonde from Moscow made me a big fan of Russian food and drink. With Sochi on every night this week and the &#34;Russian Festival&#34; coming up in SF this weekend (we&#39;ll be there) I have that nostalgia running through my mind and soon will need to make a trip back to New World Market. <br><br>PS - I also like to shop &#34;European Food&#34; on Clement (@ 32nd) because it is not as crowded and parking can be a little (but not much) better, both are good, with New World having a larger selection of fresh items.",
