"rating":"4.0",
"reviewcomment":"What can I say? I mean we&#39;re talking vegan donuts! Of course I had to find this place. It was a little hard for me to find this spot since I was unfamiliar with this indoor farmers market thing. I went from one end to the other thinking I was looking for a store or restaurant but when I finally found it It was worth it. <br><br>The donuts are different from other places since they don&#39;t sit in a case to preserve freshness so I feel like they were a tad hard. But it could also be because I showed up 10 minutes before they were closing up. They were heavy too! Very dense in a good way. Less of a airy cake and Moore like a this thick bread with really good frosting. Usually I will get a couple different donuts but despite the bright frosting or sprinkles they will taste kind of the same. Every one of these donuts had a distinct and unique taste. I some how managed to wait till we got back to our spot to cut these puppies into pieces and have a taste test with my friends. We all agreed they were not only delicious but very filling. Money well spent!",
