"reviewcomment":"Oh man, this booth is addicting!!<br><br>Musubi Kings is one of the reasons that kept me going to Off The Grid Fort Mason.  They only appeared there every other week, so I always checked my weekly Off The Grid email and made sure that they were there whenever I went.<br><br>All their Musubi costs $5 each which is actually a pretty good deal considering what you get.  Besides the usual Spam Musubi, they offer a whole variety of Musubi such as Peking Duck, Pork Belly, Bulgogi, and Banh Mi.  My two favorites are the Peking Duck Musubi and Pork Belly Musubi (<a href='http://www.yelp.com/biz_photos/TO1ccxi_Pypigtfc0dtL0Q?select=WM8uO2tG4Q6DGOOq9dSPzQ'>yelp.com/biz_photos/TO1c…</a>).  They&#39;re so good!!  Especially the Pork Belly!  And they&#39;re very meaty with a very balanced meat to rice ratio as you can see from the pic.<br><br>I can&#39;t wait for Fort Mason Off The Grid to start up again in March so I can taste their magical Musubi again.  Hopefully, I&#39;ll be able to try their other Musubi that they show on their Facebook page.  I definitely want to their their Bacon &amp; Egg and Banh Mi Musubi.<br><br>March can&#39;t come soon enough!!!",
