"rating":"4.5",
"reviewcomment":"TIP #1: You can make your own smoothies! Start with the base (milk-based or soy milk), choose the fruit combo you want, and then choose your add-ins. It&#39;s $.75 per add-in, or two for $1. Not on the menu: sugar-free chocolate sauce!<br><br>TIP #2: The meal replacement smoothies are worth the price. It&#39;s nearly impossible to get the same nutritionals as a Berrylicious smoothie without paying more.<br><br>TIP #3: Get a loyalty card--buy 7 smoothies, get your eighth one free. <br><br>Confession: sometimes, after work when I&#39;m really tired, I stop by here to get a meal replacement smoothie and call it a night. It&#39;s filling, nutritious, and yummy. It&#39;s quick and easy. It&#39;s in my gym. So what if I didn&#39;t work out right before dinner? Work is one really long workout. (I know, excuses, excuses.)<br><br>If you&#39;re looking for a supersweet candy treat smoothie, go to Jamba Juice. <br><br>They also offer breakfast for us earlybirds at the gym: oatmeal with toppings, bagels, coffee, and tea. Cheaper than a comparable meal at Starbucks or any other cafe, and probably healthier too. And sometimes, if they made too much of a smoothie, they pour the leftover stuff into little sample cups. Perfect to grab on the way out of the gym. <br><br>If you have any questions, the employees are all young and eager to help!",
