"reviewcomment":"I would probably have to vote Farley&#39;s as one of the most relaxed coffee shops that I&#39;ve been to here in San Francisco. Nestled in a quiet neighborhood in Potrero Hill, you are instinctively drawn in by the chatter and the house full of patrons eagerly waiting for their caffeine fix and clicking away on their laptops as they sip on house brewed coffee and tea. <br><br>The organic chai tea latte was creamy, piping hot, and perfectly spiced, all in a unique Farley&#39;s black and white mug. Now, the gibraltar, that monster is no joke. Perfect for those who need an extra pep in their step, nice and strong, served in a shot glass!<br><br>So what made this coffee shop so enjoyable was the fact that there were so many different things available to occupy your time. They had different board games, quirky books, current magazines, and good ol&#39; WiFi. The atmosphere is wonderfully casual, yet hipsterish at the same time. <br><br>The baristas were friendly and prompt. I would definitely recommend Farley&#39;s as a fun, cool, coffee shop to visit on a lazy day! What a hidden gem!",
