"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/NQ2RTvxJOlQeh52wgvINKg/l.jpg",
"rating":"3.5",
"reviewcomment":"Overall/Food:<br>This place is SO charming. Just your typical corner cafe in the quaint neighborhood of Castro/Upper Market (Duboce Park). I finally was able to try their breakfast today as well... Which was phenomenal. Not really a ton of options for gluten free people... Which is a bit of a disappointment. But they really know how to make a lox scramble... I&#39;d highly highly recommend doing that if you can handle salmon before 12pm. Also, when you get fruit on the side, it&#39;s not your average cantaloupe and grapes... But today they gave mango..  the first time I&#39;ve ever seen that in a restaurant.<br><br>Also, my favorite aspect... outdoor seating! It was a crisp but sunny morning...and sitting in the fresh air was glooorious. <br><br>Coffee:<br>Their Americano wasn&#39;t the best, but I&#39;d still get their almond milk latte or regular cup of joe. <br><br>Pet friendly too! Bring your pup and enjoy!!!",
