"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/qcdXpK3iyq0LEFlSENEwTA/l.jpg",
"rating":"3.5",
"reviewcomment":"Best meal EVER!!!!!!!!!!!! <br>A friend of mine wanted BBQ and there isn&#39;t much good BBQ in SF. For a super multicultural city it&#39;s pretty depressing. So it was worth giving it a try. BBQ is one of my favorite cuisines and this place rocked my socks! <br><br>First I got the &#34;safe word&#34;.... I&#39;m all about safe words so this was perfect. <br>For starters we got the sweet breads...cooked perfectly. Even the greens with the hidden jalapeños could have been a meal on its own. The deviled eggs were damn good! Yummy I wish I had more.<br><br>For the meal I got the pork ribs with greens and Brie Mac and cheese. Holy hell this stuff was good. I could have just ate the sides on their own. <br>But those ribs tho.....much bigger than I was expecting. Sooooo tender and meaty. Again cooked perfectly. The dry rub was too die for. I had a bit of the sauce...but whatever...the ribs stood on their own. My friend had the dinosaur bone. It was a big piece of meat with a large 12&#34; bone. It came out piping hot and very juicey. <br><br>This food was soooooo good. 3 hours later and I&#39;m still full. It&#39;s a bit pricey and worth every penny. I was going to ask the chef to marry me but I was soo full I could barely walk. After this glorious meal I saw they have a tasting menu for $35. That is going to happen with stretchy pants. I highly enjoyed my meal.",
