"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/0P2jA1Fy0OIhalBGqMDh9A/l.jpg",
"rating":"4.5",
"reviewcomment":"I just completed a 5-day cleanse with juice to you and I was impressed with the overall experience and especially the quality of the juice. Having done juice cleanses before, I customized my program to do a &#34;step&#34; cleanse where each day was progressively more difficult (i.e. the ratio of green juices to other juices increased until all the juices were green). They accommodated my custom menu (including a mid-week change to my last day) without error and I found everyone that I interacted with to be sincere and dedicated.<br><br>Highlights:<br>- the juice was incredibly fresh. it makes a difference. I was nervous that the green juices would be icky -- but i found them to be quite refreshing. <br>- someone else does all of the work! you just drink juice. This is very relaxing. <br>- the portions were healthy -- it felt like a meaningful amount of juice each time which meant I could enjoy drinking them (instead of gulping them down in one swoop)<br>- on any cleanse of this type you are going to have side effects (it&#39;s a big shift!) and I had all of them, with day 2 being the most difficult (caffeine withdrawal) and day 3 being the most satisfying. <br>- i had a lot of energy in the mornings, but tended to fade in the afternoon and was sometimes a bit spacey. I expected this and planned accordingly. Naps are key!<br>- the almond milk is AMAZING. I&#39;m not sure I can ever go back to the store bought stuff. <br>- I feel like I cut my sugar cravings and changed my relationship with food in terms of how much I eat and when. This is useful. <br><br>Overall, I was incredibly happy with the experience and I plan to continue to integrate their juices into my weekly regimen.",
