"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/3c8VTdxWnGDqLesQrze6hw/l.jpg",
"rating":"5.0",
"reviewcomment":"While sight seeing at Ghirardelli Square with visiting family members, we found ourselves in front of this store.  My first reaction after trying to pronounce the sign was what kind of place is this?  As I peeked into the window, my second thought was, that it was just another specialty condiments store.  But when my boyfriend went inside, I decided to follow suit as my curiosity became peaked.  It turned out that this shop had more to offer than expected!  I was amazed at the large number of choices you get in flavored oils, vinegars and powdered seasonings. <br><br>This unique store displays casks of infused oils such as extra virgin olive oils, infused oils, nut oils, seed oils, and wellness oils, featured with smooth tasting flavors like pistachio, walnut, garlic, avocado, basil, chili and a whole lot more!  <br><br>The vinegars are aged in oak barrels while blended with their own special recipes that included ingredients such as apple, cherry, lemon, grape, ginger, white or red wines and even beer!  <br><br>The friendly and helpful staff were very enthusiastic about their products and offered free tasting of any number of the oils and vinegars separately or mixed together.  At first it seemed strange for me to start tasting the oils, but the nice flavors quickly eased my mind.  Then when they combined it with a flavored vinegar, I realized how delicious mixing them both together could be!  <br><br>So many options are available here that also include a large variety of spices and seasonings.  Just find the flavors you want, purchase the size and number of bottles you want to fill, and then they fill and seal them for you so you don&#39;t have to worry about any leakage before getting them home.<br><br>This is definitely a shop that caters to anyone who enjoys gourmet cooking.  Now, the possibilities can be endless in creating your own unique recipes or give to someone as a gift.  And it&#39;s nice to know that you can also order from them online!<br><br><a href='/redir?url=http%3A%2F%2Fwww.youtube.com%2Fwatch%3Fv%3D1P4m_29MOpU&amp;s=daa92711fec81e1215fbcf842e8cc5201738d55bf3bf1e87c9389e42bb6edbe3' target='_blank' rel='nofollow'>youtube.com/watch?v=1P4m…</a>",
