"rating":"4.5",
"reviewcomment":"I don&#39;t usually have the opportunity to sleep in so you can imagine how precious my Sunday mornings are. Golden waffles are seriously one of the only things that&#39;ll make me jump out of bed. This means waking up, getting ready, and driving to Stonestown on Sunday mornings in order to catch this food truck before they leave at 1pm. No regrets. At all.<br><br>Even when I&#39;m not having a sweet tooth, just the sweet smell of mouthwatering liege waffles makes me change my mind. The waffles are always served fresh and warm, caramelized at its crust, and soft and chewy in the center. Absolute heaven. I also love how the sweetness from the sugar pearls aren&#39;t overwhelming and is a perfect compliment for a good-sized waffle. I usually like mine plain but extra plus for having condiments in case you&#39;re feeling a little bit of a heavier snack. <br><br>Seriously, no regrets.",
