"rating":"3.5",
"reviewcomment":"I usually HATE bar food/pub food because it is usually greasy and unhealthy.  <br><br>But, I have now been to 21st Amendment twice and really enjoyed both times.  Going for lunch is an entirely different experience than going at night.  When we went for lunch we easily got a table and had pretty good service.  I noticed that the lunch menu is also a little different than the dinner menu - more salads on the lunch menu. <br><br>We went on a week night during SF beer week which may be why it was PACKED.  It definitely felt more like a bar on a friday night rather than a restaurant on a wednesday night.  After standing in their upstairs area for a while we were able to grab a table. They were pouring some of their signature craft beers which you will never get to try outside of the 21st amendment brewery! <br><br>We ordered a chicken sandwhich and the reuben.  The chicken sandwich was realtively healthy, compared to a lot of other pub food.  The reuben was meh -- the pastrami was sort of dry so if you are a pastrami snob I wouldn&#39;t order it.  I ate it anyways! Our tabl had an order of onion rings which were made just right! <br><br>Over all- good food, great beer.  Really fun during Giant&#39;s games but it can be very hard to get a table/ seat at the bar!",
