"rating":"4.0",
"reviewcomment":"I very much enjoy stopping off at Lovejoy&#39;s Attic on my way home after work on my scooter.   <br><br>My first vehicle I owned while growing up in San Francisco was a Vespa Primavera 125.  I always wore vintage 3 button coats and vintage gloves when I rode my scooter.  I&#39;ve been an avid collector of vintage gloves since high school.  Because of this, I ADORE Lovejoy&#39;s attic.<br><br>Not only do they have a wonderful, affordable collection of vintage tea-things, but they also have vintage GLOVES!  I&#39;m typically the girl in the motorcycle helmet digging through the pile and trying on gloves  they have in the window.  <br><br>Quarters ARE tight SO, best to get into the shop prior to the throngs arriving. <br><br>If you DO have children ladies and gents, simply take time to have a chat with them just prior to going in and have your kids practice the following:<br><br>1)  Look but don&#39;t touch.<br>2)  Move SLOWLY through the store.  Good opportunity to practice good manners<br>      like, &#34;May I please?&#34;, &#34;excuse me&#34;, &#34;thank you&#34;.<br>3)  Use inside voices.<br>4)  Remind them that they&#39;ll each receive a memorable little something-treat if<br>      they&#39;re on their best behavior.  <br>5)  Always be respectful of others and repeat #2.<br><br>Make sense?  Oh good!  ;)!",
