"reviewcomment":"A corner store in the TL that manages to stay clean deserves four stars.  Period.  So that&#39;s where those came from.<br><br>The additional star is for the facts that they are well-stocked, have friendly employees, and don&#39;t put up with the in-store or just-outside-of-store presence of crazy conmen trying to run some sort of shady game.  OK, I&#39;ll admit that crazy conmen in the TL aren&#39;t the toughest to spot, as they&#39;re in the TL because their skills have deteriorated from their height in 1983 or whatever, but a conman past his prime is a dangerous conman; whereas in the old days you&#39;d just lose your wallet and not notice until a solid seven minutes later, now you might catch him trying to lift your wallet, and then what do you do?  Fight?  Grab him?  Block his way?  Disabuse him of his wannabe-pimp cane?  None of these options are appealing, especially in the TL.<br><br>Take it from a paranoid mark if ever there was one:  If you need a convenience store in the TL and don&#39;t want to deal with the TL, duck into Tsunami Market for a second and let your guard down--OK, maybe that&#39;s bad advice.  Pretend to relax.  That&#39;s better.",
