"rating":"5.0",
"reviewcomment":"A late night grocery oasis in the area.<br><br>I&#39;ve always loved walking past Sunny Country. Their hanging baskets, blooming flowers, and glowing fruit have always struck me as being so European.<br><br>The owner or one of their staff is usually outside tending to the fresh flowers and greeting passerby with genuine smiles and hellos.<br><br>It wasn&#39;t till my most recent night walk that I actually stepped foot inside this quaint store. I was so surprised to see it still open at around 11:30pm. Their fruit lined their sidewalk in big bins - inviting in late night customers.<br><br>I roamed around inside and was pleasantly surprised to see a variety of granola and oats, organic chicken apple sausage, brown rice cakes, Casa Sanchez chips, salsa, and guacamole, and a plethora of healthy frozen meals intermingled between your standard convenience store items.<br><br>I didn&#39;t end up purchasing anything - since I was on my way to meet someone, but I am absolutely delighted that a late night, inviting grocery spot like this this exists in the hood. There&#39;s no need to lug your wallet over to Safeway - when Sunny County radiates such good energy on Stanyan.<br><br>Trust.",
