"rating":"4.0",
"reviewcomment":"I&#39;m going to keep it real: I don&#39;t know jack about Anthony Bourdain nor do I care about his recommendation. <br><br>I strolled into this place because my boyfriend and I were hungry, were out and about looking for a spot to get our late night grub on, walked past this store, got a whiff of something awesome, scoped the little Latina lady chef&#39;ing it up at the grill, looked at each other and thought, &#34;Fuck it. Let&#39;s do it.&#34;<br><br>I&#39;m from the East Coast so sketchy corner stores (or bodegas as we like to call them) serving up something proper and delicious is no surprise to me. This place is a liquor store/bodega/cafeteria type spot. Essentially, you&#39;re dining in at a Liquor Store, so ambiance is severely lacking. Your food even comes with a pack of Newports on the side.<br><br>I kid, of course. <br><br>Environment aside, this place is <a href='/redir?url=http%3A%2F%2Fbomb.com&amp;s=bb4f996415a9c2f21137e27cfb68f439a48cec2652b53e9b50dd7e766dbe177e' target='_blank' rel='nofollow'>bomb.com</a>. Yes, I used that incredibly cheesy phrase. It&#39;s justified.<br><br>These tortas are INSANE. I had the Milanesa which was deliciosooooo. My boyfriend ordered the famous &#34;Cubana&#34; which we had no idea was so famous until after the fact. Gargantuan in size containing every meat you could possibly think of. Meat Lovers, you will be so happy you ordered this bad boy.<br><br>Authentic. Tasty. Perfect. So glad we found this little spot and I will, without a doubt, return next time I visit the Bay area.",
