"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/ug86XjFAdgCrgnJSLqSbVQ/l.jpg",
"rating":"4.0",
"reviewcomment":"I think I have been to one coffee location with Peets name that has had good WiFi. There should be ratings of WiFi services. Peets WiFi truly sucks. They pour coffee and understand not one cent beyond that. Cafes have been around forever. Coffeeshops historically have been dynamic places. They arrive in America and get perverted into whatever brings a dollar in. Then they grow with the culture and become vital and vibrant again. That becomes the expectation and standard. They don&#39;t sell coffee. They are bigger in a cultural sense. That is the cultural standard. Even Starbucks understand that. The once locked and pqay-for-a-little ATT WiFi eventually became free and abundant. Progress for American culture. Others never will reach there because they never get anywhere. They understand a money versus receipt as beginning, middle and end. There cannot possibly be anything beyond the coffee machine and cash register to this business. WiFi is not the issue here. The inability to think is. Somebody thought them how to count to 5 and that is all they do. There is no possibility counting can go on beyond 5 and why? Because they lack any understanding of the business. They duplicated what somebody else would have and got stuck there. Ironic is the history of these firms how one begins and another develops while some never grow. This is a great location for Peets and though small they always do interior design very well at all Peets and sell coffee. The world is so small. 25 Oct 2013",
