"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/KgN3gh1FE_AnOfJqB4O2Ag/l.jpg",
"rating":"4.0",
"reviewcomment":"In the past two weeks I must have stopped by Panaderia Andrea about 4 or 5 times.  And my experience only gets better with each visit. <br><br>For anyone that doesn&#39;t know, Panaderia Andrea specializes in El Salvadorian and Guatemalan breads/pan dulce.  The shop offers various other offerings such as atole and tamales but I have yet to try these.  There is limited seating inside so be prepared to take your items to go just in case.  And be forewarned, parking can be difficult so it might be best to look for parking on London instead of Mission.<br><br> I have been more than satisfied with everything I have tried so far.  The pastelitos are great and a bargain at only $0.50 each (I recommend pineapple and strawberry).  The santanecas are delicious and inexpensive at $0.50 each.  I have tried a variety of the cookies ($0.50) and I assure you that you won&#39;t be disappointed with any of them.  I&#39;ve become a huge fan of a Guatemalan pan dulce they sell which I believe is called a cortada.  Someone can correct me if I am wrong.  This pan dulce is usually on the bottom rack all the way on the right.  It appears to be one long segmented piece of pan dulce and each segment is $0.50.  The mini quesadillas are $1.50 and they are fantastic!  I love the flavor and texture.  I look forward to trying their semita alta on a future visit.<br><br>Oh - and to top it all off the service is friendly and warm.  I&#39;ve interacted with 3 different employees so far and each has been wonderful.  I highly recommend stopping by if you&#39;ve got a thing for pan dulce or if you&#39;re just curious.",
