"rating":"3.5",
"reviewcomment":"Was walking in the area on President&#39;s day and felt the urge for some caffeine.  Saw the Starbucks across from the Pyramid building and hoped that it was open considering it was a holiday and FiDi was pretty quiet.<br><br>Yep, it was open.  Yes, gonna get my caffeine.  What surprised me was that they quite crowded in that most of the tables were taken.  After ordering my cup of Starbucks, I took was able to park myself at a vacant bar table to chill with my cup of Joe.<br><br>This Starbucks was large, modern, and spacious.  The counter/barista area is in the center of the store.  There were about a ten bar stools surround two sides creating a bar-style setting.  There were about a dozen tables on the side of the store, a mixture of regular and bar style tables.  The crowd were a mixture of families, tourists, gentlemen playing chess and some of with laptops utilizing the free Wi-Fi. <br><br>Overall, a nice large and spacious Starbucks for your caffeine fix. <br><br>(<a href='http://www.yelp.com/biz_photos/starbucks-san-francisco-130?select=B81rp89hqK2OcBbi-dMX3w#B81rp89hqK2OcBbi-dMX3w'>yelp.com/biz_photos/star…</a>)<br>(<a href='http://www.yelp.com/biz_photos/starbucks-san-francisco-130?select=B81rp89hqK2OcBbi-dMX3w#cyqGkYjN-6NfGq0yALqcpw'>yelp.com/biz_photos/star…</a>)",
